const tableBackgrounds = [{"ID":0,"NAME":"Acolyte","SKILL_PROFICIENCIES":"insight, religion","LANGUAGES":null,"LANGUAGES_COUNT":2,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I idolize a particular hero of my faith, and constantly refer to that person's deeds and example.-----I can find common ground between the fiercest enemies, empathizing with them and always working toward peace.-----I see omens in every event and action. The gods try to speak to us, we just need to listen.-----Nothing can shake my optimistic attitude.-----I quote (or misquote) sacred texts and proverbs in almost every situation.-----I am tolerant (or intolerant) of other faiths and respect (or condemn) the worship of other gods.-----I've enjoyed fine food, drink, and high society among my temple's elite. Rough living grates on me.-----I've spent so long in the temple that I have little practical experience dealing with people in the outside world.","IDEAL":"Tradition. The ancient traditions of worship and sacrifice must be preserved and upheld. (Lawful)-----Charity. I always try to help those in need, no matter what the personal cost. (Good)-----Change. We must help bring about the changes the gods are constantly working in the world. (Chaotic)-----Power. I hope to one day rise to the top of my faith's religious hierarchy. (Lawful)-----Faith. I trust that my deity will guide my actions. I have faith that if I work hard, things will go well. (Lawful)-----Aspiration. I seek to prove myself worthy of my god's favor by matching my actions against his or her teachings. (Any)","BOND":"I would die to recover an ancient relic of my faith that was lost long ago.-----I will someday get revenge on the corrupt temple hierarchy who branded me a heretic.-----I owe my life to the priest who took me in when my parents died.-----Everything I do is for the common people.-----I will do anything to protect the temple where I served.-----I seek to preserve a sacred text that my enemies consider heretical and seek to destroy.","FLAW":"I judge others harshly, and myself even more severely.-----I put too much trust in those who wield power within my temple's hierarchy.-----My piety sometimes leads me to blindly trust those that profess faith in my god.-----I am inflexible in my thinking.-----I am suspicious of strangers and expect the worst of them.-----Once I pick a goal, I become obsessed with it to the detriment of everything else in my life."},{"ID":1,"NAME":"Anthropologist","SKILL_PROFICIENCIES":"insight, religion","LANGUAGES":null,"LANGUAGES_COUNT":2,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I prefer the company of those who aren't like me, including people of other races-----I'm a stickler when it comes to observing proper etiquette and local customs-----I would rather observe than meddle-----By living among violent people, I have become desensitized to violence.-----I would risk life and limb to discover a new culture or unravel the secrets of a dead one.-----When I arrive at a new settlement for the first time, I must learn all its customs.","IDEAL":"Discovery. I want to be the first person to discover a lost culture. (Any)-----Distance. One must not interfere with the affairs of another culture - even one in need of aid. (Lawful)-----Knowledge. By understanding other races and cultures, we learn to understand ourselves. (Any)-----Power. Common people crave strong leadership, and I do my utmost to provide it. (Lawful)-----Protection. I must do everything possible to save a society facing extinction. (Good)-----Indifferent. Life is cruel. What's the point in saving people if they're going to die anyway? (Chaotic)","BOND":"My mentor gave me a journal filled with lore and wisdom. Losing it would devastate me.-----Having lived among the people of a primeval tribe or clan, I long to return and see how they are faring.-----Years ago, tragedy struck the members of an isolated society I befriended, and I will honor them.-----I want to learn more about a particular humanoid culture that fascinates me.-----I seek to avenge a clan, tribe, kingdom, or empire that was wiped out.-----I have a trinket that I believe is the key to finding a long-lost society.","FLAW":"Boats make me seasick.-----I talk to myself, and I don't make friends easily.-----I believe that I'm intellectually superior to people from other cultures and have much to teach them.-----I've picked up some unpleasant habits living among goblins, lizardfolk, or orcs.-----I complain about everything.-----I wear a tribal mask and never take it off."},{"ID":2,"NAME":"Archaeologist","SKILL_PROFICIENCIES":"history, survival","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I love a good puzzle or mystery-----I'm a pack rat who never throws anything away.-----Fame is more important to me than money.-----I have no qualms about stealing from the dead.-----I'm happier in a dusty old tomb than I am in the centers of civilization.-----Traps don't make me nervous. Idiots who trigger traps make me nervous.-----I might fail, but I will never give up.-----You might think I'm a scholar, but I love a good brawl. These fists were made for punching.","IDEAL":"Preservation. That artifact belongs in a museum. (Good)-----Greed. I won't risk my life for nothing. I expect some kind of payment. (Any)-----Death Wish. Nothing is more exhilarating than a narrow escape from the jaws of death. (Chaotic)-----Dignity. The dead and their belongings deserve to be treated with respect. (Lawful)-----Immortality. All of my exploring is part of a plan to find the secret of everlasting life. (Any)-----Danger. With every great discovery comes grave danger. The two walk hand in hand. (Any)","BOND":"Ever since I was a child, I've heard stories about a lost city. I aim to find it, learn its secrets, and earn my place in the history books.-----I want to find my mentor, who disappeared on an expedition some time ago.-----I have a friendly rival. Only one of us can be the best, and I aim to prove it's me.-----I won't sell an art object or other treasure that has historical significance or is one of a kind.-----I'm secretly in love with the wealthy patron who sponsors my archaeological exploits.-----I hope to bring prestige to a library, a museum, or a university.","FLAW":"I have a secret fear of some common wild animal - and in my work, I see them everywhere.-----I can't leave a room without searching it for secret doors.-----When I'm not exploring dungeons or ruins. I get jittery and impatient.-----I have no time for friends or family. I spend every waking moment thinking about and preparing for my next expedition.-----When given the choice of going left or right, I always go left.-----I can't sleep except in total darkness."},{"ID":4,"NAME":"Athlete","SKILL_PROFICIENCIES":"acrobatics, athletics","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I feel most at peace during physical exertion, be it exercise or battle.-----I don't like to sit idle.-----I have a daily exercise routine that I refuse to break.-----Obstacles exist to be overcome.-----When I see others struggling, I offer to help.-----I love to trade banter and gibes.-----Anything worth doing is worth doing best.-----I get irritated if people praise someone else and not me.","IDEAL":"Competition. I strive to test myself in all things. (Chaotic)-----Triumph. The best part of winning is seeing my rivals brought low. (Evil)-----Camaraderie. The strongest bonds are forged through struggle. (Good)-----People. I strive to inspire my spectators. (Neutral)-----Tradition. Every game has rules, and the playing field must be level. (Lawful)-----Growth. Lessons hide in victory and defeat. (Any)","BOND":"My teammates are my family.-----I will overcome a rival and prove myself their better.-----My mistake got someone hurt. I'll never make that mistake again.-----I will be the best for the honor and glory of my home.-----The person who trained me is the most important person in my world.-----I strive to live up to a specific hero's example.","FLAW":"I indulge in a habit that threatens my reputation or my health.-----I'll do absolutely anything to win.-----I ignore anyone who doesn't compete and anyone who loses to me.-----I have lingering pain from old injuries.-----Any defeat or failure on my part is because my opponent cheated.-----I must be the captain of any group I join."},{"ID":20,"NAME":"Black Fist Double Agent","SKILL_PROFICIENCIES":"deception, insight","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"People are only as trustworthy as you are valuable to them. Always strive to be the most valuable person around.-----My eloquence and sophistication are tools I use to avoid arousing suspicion myself.-----I am a thrill-seeker, excited by covert and dangerous missions.-----I live by my wits and always check every lock twice, just to be certain.-----I never admit to my mistakes lest they be used against me.-----I take every effort to be unnoticeable and blend into the crowd. Passersby rarely give me a second look.-----I am prepared for any eventuality; including the day my usefulness as a spy comes to an end.-----I always make certain to know my enemy before acting, lest I bite off more than I can chew.","IDEAL":"Suspicious. In my experience, everybody has something to hide, and what they hide can usually hurt me. (Any)-----Secretive. I trade in secrets, and am not about to let any of mine slip. (Any)-----Hedonist. Life is short. I live my life to the fullest, as I know any day could be my last. (Chaotic)-----Selfless. I use my position to help the downtrodden avoid persecution from the authorities. (Good)-----Patriotic. I am a loyal supporter of Phlan and its leaders, and see my role as a solemn duty and necessary evil to prevent anarchy. (Lawful)-----Manipulative. I use my knowledge to blackmail and manipulate others to my own benefit. (Evil)","BOND":"I was framed for a crime I did not commit, and seek to bring the true culprit to justice.-----I am a part of an underground network that smuggles innocent civilians out of the city prior to being raided by the authorities.-----I miss the glory days of Phlan, before the coming of the dragon.-----I seek to prove myself worthy of joining the Black Fist as a member of their order.-----My sister was killed by a Tear of Virulence, and now I feed them false information whenever possible.-----My family was wrongly imprisoned, and I act as an informant in order to secure their release.","FLAW":"I think too highly of myself, and have an exaggerated sense of self-importance.-----I have difficulty trusting strangers. I see spies and informants everywhere.-----Years of getting away with minor crimes has left me believing that I am above the law, and have diplomatic immunity above my station.-----Years of seeing innocent people suffer have left me despondent and pessimistic for the future.-----My desire for vengeance often gets me into trouble.-----I am spendthrift, and share my wealth with the patrons of my favorite tavern."},{"ID":21,"NAME":"Boros Legionnaire","SKILL_PROFICIENCIES":"athletics, intimidation","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I approach every task with the same high degree of military precision.-----I am always the first into the fray.-----I bear any injury or indignity with stoic discipline.-----My righteous wrath is easily inflamed by the slightest iniquity.-----My honor is more important to me than my life.-----Dangerous work is best accomplished by an orderly group working with common purpose.-----I treat my weapons, uniform, and insignia with reverence, for they are gifts of the angels.-----I pace when standing and fidget incessantly when forced to sit.","IDEAL":"{@b Guild}. My guild is all that really matters. (Any)-----{@b Justice}. Achieving justice requires establishing fair, equitable, and compassionate relationships within a community. (Good)-----{@b Protection}. It isn't right for innocents to suffer because of the arrogance of the powerful. (Good)-----{@b Solidarity}. It is most crucial to act with a single will, marching side by side in perfect accord. (Lawful)-----{@b Order}. Society functions only if people do their duty and respect the chain of command. (Lawful)-----{@b Conviction}. Anything worth doing is worth doing with your whole heart. (Lawful)","BOND":"I would lay down my life for Aurelia and the angels.-----I owe my life to the Boros captain who took me in when I was living on the streets.-----My fellow legionnaires are my family.-----I wield the same Boros weapon my grandparent did, for the honor of our family.-----I ran with the Rakdos in my youth, and I'm striving to atone for my past misdeeds.-----I do what I can to help out the spouse of a comrade who died in battle.","FLAW":"I act bravely when I'm in a group, but I'm a coward when I'm alone.-----I see everything in clear-cut black and white.-----I'm just a little fascinated by the ways of the Gruul.-----I trust the chain of command more than anything\u2014more even than my closest friends.-----I'm slow to trust members of other guilds.-----I've been known to turn a blind eye to injustice, with the help of a modest bribe."},{"ID":22,"NAME":"Caravan Specialist","SKILL_PROFICIENCIES":"animal handling, survival","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"Any group is only as strong as its weakest link. Everyone has to pull their own weight. -----There's always someone out there trying to take what I've got. Always be vigilant.-----Anything can be learned if you have the right teacher. Most folks just need a chance.-----Early to bed and early to rise; this much at least is under my control.-----You can listen to me or don't and wish you had. Everyone ends up on one side of that fence.-----Eventually my hard work will be rewarded. Maybe that time has finally come.-----A strong ox or horse is more reliable than most people I've met.-----I never had time for books, but wish I had. I admire folks who have taken the time to learn.","IDEAL":"Service. Using my talents to help others is the best way of helping myself. (Good)-----Selfish. What people don't know WILL hurt them, but why is that my problem? (Evil)-----Wanderer. I go where the road takes me. Sometimes that's a good thing... (Chaotic)-----Fittest. On the open road, the law of nature wins. Victims are the unprepared. (Lawful)-----Focused. I simply have a job to do, and I'm going to do it. (Neutral)-----Motivated. There's a reason I'm good at what I do, I pay attention to the details. (Any) ","BOND":"My brother has a farm In Elmwood and I've helped him and his neighbors move their goods to Mulmaster and other surrounding towns. Those are good people.-----A caravan I lead was attacked by bandits and many innocents died. I swear that I will avenge them by killing any bandits I encounter.-----The Soldiery are mostly good guys who understand the importance of protecting the roads. The City Watch is who you have to look out for. If they are inspecting your goods, get ready to pay a fine.-----The new commander of Southroad Tower, Capt. Holke, understands the importance of safe roads. He's hired me for several jobs and I'm grateful.-----There's always a road I haven't traveled before. I'm always looking for new places to explore.-----Wealth and power mean little without the freedom to go where and when you want.","FLAW":"I have trouble trusting people I've just met.-----I enjoy the open road. Underground and tight spaces make me very nervous.-----I expect others to heed my orders and have little respect or sympathy if they don't.-----I am very prideful and have trouble admitting when I'm wrong.-----Once I decide on a course of action, I do not waiver.-----I like to explore, and my curiosity will sometimes get me into trouble."},{"ID":23,"NAME":"Celebrity Adventurer's Scion","SKILL_PROFICIENCIES":"perception, performance","LANGUAGES":null,"LANGUAGES_COUNT":2,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I will never get out of my famous parent's shadow, and no one else will ever understand this burden.-----I've seen enough of the adventuring life to have realistic expectations and empathy for my peers.-----Living up to my legacy will be difficult, but I'm going to do it.-----I'm used to the very best in life, and that's a hard habit to break.-----My parent taught me a sense of duty. I strive to uphold it, even when the odds are against me.-----No one can fake a smile, a handshake, or an interested nod like I can.-----I've been part of the adventuring life since I was old enough to walk. Let me explain a few things to you.-----No risk is too great for the rewards of defeating my enemies... and taking their stuff.","IDEAL":"Power. The only way to get ahead in this world is to attain power and hold onto it with all your might. (Evil)-----Peace. Those who can find or make peace in the chaotic world around them have everything. (Lawful)-----Fame. I've seen what fame can bring. And I'll do anything to get all that for myself. (Neutral)-----Training. Hard work, sacrifice, and training lead to success\u2014and eventually to perfection. (Any)-----Anonymity. I want to be successful. And alone. With lots of guards and wards between me and everyone else in the world. (Any)-----Wisdom. Material wealth is an illusion. Wisdom is the real treasure. (Good)","BOND":"While my parent was out adventuring, a servant raised me, and I care about that person more than anyone.-----I consider every member of my parent's former adventuring party to be family.-----Despite their absences, my famous parent was kind and generous. I love them and want to make them proud.-----My parent once brought a cursed magic item home. It is my obsession.-----My childhood home holds all my best memories, and its upkeep is my primary concern.-----Growing up, I had an imaginary friend I could always count on. That friend is still with me.","FLAW":"You don't know what I'm going through. You never can.-----You. Fetch my cloak. And maybe rub my feet for a while.-----My comrades are brave, but I must defeat this threat alone to prove my worth.-----Oh, yeah, that spell? Named after my parent's best friend. Let me tell you about them.-----My best days are behind me. Ahead lies only toil, pain, and death.-----You have to look out for yourself. No one else will."},{"ID":24,"NAME":"Charlatan","SKILL_PROFICIENCIES":"deception, sleight of hand","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I fall in and out of love easily, and am always pursuing someone.-----I have a joke for every occasion, especially occasions where humor is inappropriate.-----Flattery is my preferred trick for getting what I want.-----I'm a born gambler who can't resist taking a risk for a potential payoff.-----I lie about almost everything, even when there's no reason to.-----Sarcasm and insults are my weapons of choice.-----I keep multiple holy symbols on me and invoke whatever deity might come in useful at any given moment.-----I pocket anything I see that might have some value.","IDEAL":"Independence. I am a free spirit\u2014no one tells me what to do. (Chaotic)-----Fairness. I never target people who can't afford to lose a few coins. (Lawful)-----Charity. I distribute the money I acquire to the people who really need it. (Good)-----Creativity. I never run the same con twice. (Chaotic)-----Friendship. Material goods come and go. Bonds of friendship last forever. (Good)-----Aspiration. I'm determined to make something of myself. (Any)","BOND":"I fleeced the wrong person and must work to ensure that this individual never crosses paths with me or those I care about.-----I owe everything to my mentor\u2014a horrible person who's probably rotting in jail somewhere.-----Somewhere out there, I have a child who doesn't know me. I'm making the world better for him or her.-----I come from a noble family, and one day I'll reclaim my lands and title from those who stole them from me.-----A powerful person killed someone I love. Some day soon, I'll have my revenge.-----I swindled and ruined a person who didn't deserve it. I seek to atone for my misdeeds but might never be able to forgive myself.","FLAW":"I can't resist a pretty face.-----I'm always in debt. I spend my ill-gotten gains on decadent luxuries faster than I bring them in.-----I'm convinced that no one could ever fool me the way I fool others.-----I'm too greedy for my own good. I can't resist taking a risk if there's money involved.-----I can't resist swindling people who are more powerful than me.-----I hate to admit it and will hate myself for it, but I'll run and preserve my own hide if the going gets tough."},{"ID":29,"NAME":"Cormanthor Refugee","SKILL_PROFICIENCIES":"nature, survival","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I long for a home that never really existed, whether in the camps, Hillsfar, or Myth Drannor.-----Though I am not an elf, I am a fervent, radical worshipper of the elven gods.-----I live in the moment, knowing my life could be turned upside down any day.-----I appreciate beauty in all of its forms.-----I hate the dark elves and the Netherese for each driving the elves out of Cormanthyr in the past.-----I am a forest bumpkin who grew up in a tent in the woods and is wholly ignorant of city life.-----I was raised alongside children of many other races. I harbor no racial prejudices at all.-----The elves have just the right word for so many things that cannot be expressed as well in other languages. I pepper my speech with elven words, phrases, and sayings.","IDEAL":"Patient. The elves have taught me to think and plan for the long-term. (Lawful)-----Rebellious. Governments and politicians drove my family to the camps. I subtly defy authority whenever I think I can get away with it. (Chaotic)-----Self - Absorbed. I've had to look out for number one so long that it has become second nature. (Any)-----Wanderlust. I want to see as much of the world beyond the camps as I can. (Any)-----Generous. I give everything I can to help those in need, regardless of who they are. (Good)-----To the Abyss with Them. The people of Hillsfar cast me out. I won't risk my hide to help them. (Evil)","BOND":"The elves took me in when I had nowhere else to go. In return, I do what I can to help elves in need.-----I seek revenge against the people of Hillsfar for driving my family into the forest.-----My family lost everything when they were driven from Hillsfar. I strive to rebuild that fortune.-----The forest has provided me with food and shelter. In return, I protect forests and those who dwell within.-----I am deeply, tragically in love with someone whose racial lifespan is far longer or shorter than mine.-----Members of my extended family did not make it to the camps or have been kidnapped to fight in the Arena. I search for them tirelessly.","FLAW":"I am very uncomfortable indoors and underground.-----I am haughty. I grew up among the elves and emulate them. Other races are crude in comparison.-----Elf this, elf that. I am sick and tired of the elves.-----I am a miser. Having lost everything once before, I clutch my possessions and wealth very tightly.-----I am a moocher. I am so used to others providing for me that I have come to expect everyone to do it.-----I believe the gods have cursed me, my family, and all of the Cormanthor refugees. We are all doomed, doomed I tell you!"},{"ID":31,"NAME":"Criminal","SKILL_PROFICIENCIES":"deception, stealth","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I always have a plan for when things go wrong.-----I am always calm, no matter what the situation. I never raise my voice or let my emotions control me.-----The first thing I do in a new place is note the locations of everything valuable\u2014or where such things could be hidden.-----I would rather make a new friend than a new enemy.-----I am incredibly slow to trust. Those who seem the fairest often have the most to hide.-----I don't pay attention to the risks in a situation. Never tell me the odds.-----The best way to get me to do something is to tell me I can't do it.-----I blow up at the slightest insult.","IDEAL":"Honor. I don't steal from others in the trade. (Lawful)-----Freedom. Chains are meant to be broken, as are those who would forge them. (Chaotic)-----Charity. I steal from the wealthy so that I can help people in need. (Good)-----Greed. I will do whatever it takes to become wealthy. (Evil)-----People. I'm loyal to my friends, not to any ideals, and everyone else can take a trip down the Styx for all I care. (Neutral)-----Redemption. There's a spark of good in everyone. (Good)","BOND":"I'm trying to pay off an old debt I owe to a generous benefactor.-----My ill-gotten gains go to support my family.-----Something important was taken from me, and I aim to steal it back.-----I will become the greatest thief that ever lived.-----I'm guilty of a terrible crime. I hope I can redeem myself for it.-----Someone I loved died because of a mistake I made. That will never happen again.","FLAW":"When I see something valuable, I can't think about anything but how to steal it.-----When faced with a choice between money and my friends, I usually choose the money.-----If there's a plan, I'll forget it. If I don't forget it, I'll ignore it.-----I have a 'tell' that reveals when I'm lying.-----I turn tail and run when things look bad.-----An innocent person is in prison for a crime that I committed. I'm okay with that."},{"ID":32,"NAME":"Dimir Operative","SKILL_PROFICIENCIES":"deception, stealth","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I'm good at hiding my true thoughts and feelings.-----When I'm in doubt about revealing something, I assume it's a secret, and I don't share it.-----I like to sound mysterious, because wisdom hidden grows deeper with time.-----I have no patience with people who get in my way.-----I love hearing about other people's nightmares.-----Combat is meant to be quick, clean, and one-sided.-----I like to stick to the shadows.-----I never show my anger. I just plot my revenge.","IDEAL":"{@b Guild}. My true guild is all that really matters. (Any)-----{@b Control}. I like pulling the strings. (Lawful)-----{@b Secrets}. I collect secrets and never reveal them. (Any)-----{@b Knowledge}. I want to know as much as I can about this city and how it works. (Any)-----{@b Independence}. I value the freedom to pursue my own goals without interference. (Chaotic)-----{@b Nihilism}. I don't believe in anything, and anyone who does is a fool. (Neutral)","BOND":"I discovered a secret I can't let anyone else uncover\u2014including my guild superiors.-----I formed a close friendship or romance with someone in the guild I'm infiltrating.-----The Dimir agent who recruited me was unmasked and killed. My revenge on the killers will be thorough and painful.-----I spend as much time as I can in the Ismeri Library because I'm certain an information hub operates behind its facade. I want its secrets!-----I'm utterly loyal to my superior in the guild, more than to the guild or its guildmaster.-----Someone has discovered my true identity.","FLAW":"I like secrets so much that I'm reluctant to share details of a plan even with those who need to know.-----I would let my friends die rather than reveal my true identity.-----I have trouble trusting anyone but myself.-----I have a particular vice that puts all my secrets at risk if I'm not careful.-----I'm pretty sure I've done something horrible that I can't remember because of the guild's mind magic.-----I put too much trust in the people who give me orders."},{"ID":34,"NAME":"Dragon Casualty","SKILL_PROFICIENCIES":"intimidation, survival","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I am driven to escape my past, and rarely stay in one place long.-----I know secrets of the Maimed Virulence, but fear the harm that may befall me should others learn them.-----Speaking of my ordeal helps sooth the still open wounds in my soul.-----My former life is meaningless, and was ripped to shreds by the claws of Vorgansharax. All that matters now is what I do with the future.-----I have faced the worst a dragon can deliver and survived. I am fearless, and my resolve unshakable.-----I am haunted my tortured past, and wake at night screaming at half-remembered horrors.-----I sleep with my back to a wall or tree, and a weapon within arm's reach.-----I am slow to trust, but incredibly loyal to those who have earned it.","IDEAL":"Survivor. No matter the cost, I will take any action necessary to survive. (Any)-----Independence. When in trouble, the only person I can rely on is myself. (Chaotic)-----Compassionate. I have suffered long at the hands of a Dragon, and take pity and compassion on the suffering of others. (Good)-----Secretive. I am withdrawn, and hide my monstrous appearance for fear of drawing unwanted attention. (Chaotic)-----Justice. I have been wronged, and will not allow the same fate to befall others. (Lawful)-----Sycophant. During my ordeal, I became a willing servant of the Maimed Virulence, and spy on his behalf. (Evil)","BOND":"I have sworn vengeance on the Maimed Virulence and those that follow him.-----I long to reunite with friends and family who may dwell among the Phlan Refugees, and protect them.-----While a prisoner of the Maimed Virulence, I overheard rumors of an item or treasure the Dragon seeks. I will have that treasure for myself!-----I seek to reclaim and rebuild my former life to the best of my ability.-----I have been reborn as a child of Vorgansharax. I will claim my birthright as his chosen heir and successor.-----I attribute my survival to the work of the divine, and seek to prove myself worthy of the honor.","FLAW":"I have been touched with dragon-greed, and have a lust for wealth which can never be satisfied.-----I secretly believe others are plotting to harm me.-----I no longer enjoy the simple pleasures in life. Food is but ashes and bile in my throat.-----Anyone who refuses to celebrate my celebrity does not deserve my company.-----I am paranoid and overly suspicious of others. Anyone may be an agent of the Maimed Virulence.-----Once I make up my mind, I follow my chosen course of action regardless of the consequences."},{"ID":35,"NAME":"Earthspur Miner","SKILL_PROFICIENCIES":"athletics, survival","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"Nothing bothers me for long.-----I hate the horrors of the Underdark with a passion. They took my friends and family and almost got me.-----Anything worth doing takes time and patience. I have learned to plan and wait for the things I want and to be patient to achieve my goals.-----I can party with everyone. Whether with dwarves, or goliaths, or deep gnomes, I can find a way to have a good time.-----I'd rather be mining. This is okay; mining is better.-----I think that I will stumble upon great riches if I just keep looking.-----People who don't work with their hands and who live in houses are soft and weak.-----I wish I were more educated. I look up to people who are.","IDEAL":"Generosity. The riches of the earth are to be shared by all. (Good)-----Greed. Gems and precious metals, I want them all for myself. (Evil)-----Mooch. Property, schmoperty. If I need it, I take and use it. If I don't, I leave it for someone else. (Chaotic)-----Boundaries. Everything and everyone has its prescribed place; I respect that and expect others to do the same. (Lawful)-----Let it Be. I don't meddle in the affairs of others if I can avoid it. They're none of my business. (Neutral)-----Materialist. I want riches to improve my life. (Any)","BOND":"The people of the Earthspur mines are my family. I will do anything to protect them.-----A deep gnome saved my life when I was injured and alone. I owe his people a great debt.-----I must behold and preserve the natural beauty of places below the earth.-----Gems hold a special fascination for me, more than gold, land, magic, or power.-----I want to explore new depths and scale new heights.-----Someday I'm going to find the mother lode, then I'll spend the rest of my life in luxury.","FLAW":"I'm uncomfortable spending time under the open sky. I'd rather be indoors or underground.-----I'm not used to being around other people much and sometimes get grouchy about it.-----Good tools are more reliable than people. In a cave in, I would save a sturdy pick before a stranger.-----I jealously guard my secrets, because I think others will take advantage of me if they learn what I know.-----I am obsessed with getting rich. I always have a scheme brewing for making it big.-----I'm afraid of the dark."},{"ID":36,"NAME":"Entertainer","SKILL_PROFICIENCIES":"acrobatics, performance","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I know a story relevant to almost every situation.-----Whenever I come to a new place, I collect local rumors and spread gossip.-----I'm a hopeless romantic, always searching for that \"special someone\".-----Nobody stays angry at me or around me for long, since I can defuse any amount of tension.-----I love a good insult, even one directed at me.-----I get bitter if I'm not the center of attention.-----I'll settle for nothing less than perfection.-----I change my mood or my mind as quickly as I change key in a song.","IDEAL":"Beauty. When I perform, I make the world better than it was. (Good)-----Tradition. The stories, legends, and songs of the past must never be forgotten, for they teach us who we are. (Lawful)-----Creativity. The world is in need of new ideas and bold action. (Chaotic)-----Greed. I'm only in it for the money and fame. (Evil)-----People. I like seeing the smiles on people's faces when I perform. That's all that matters. (Neutral)-----Honesty. Art should reflect the soul; it should come from within and reveal who we really are. (Any)","BOND":"My instrument is my most treasured possession, and it reminds me of someone I love.-----Someone stole my precious instrument, and someday I'll get it back.-----I want to be famous, whatever it takes.-----I idolize a hero of the old tales and measure my deeds against that person's.-----I will do anything to prove myself superior to my hated rival.-----I would do anything for the other members of my old troupe.","FLAW":"I'll do anything to win fame and renown.-----I'm a sucker for a pretty face.-----A scandal prevents me from ever going home again. That kind of trouble seems to follow me around.-----I once satirized a noble who still wants my head. It was a mistake that I will likely repeat.-----I have trouble keeping my true feelings hidden. My sharp tongue lands me in trouble.-----Despite my best efforts, I am unreliable to my friends."},{"ID":37,"NAME":"Faceless","SKILL_PROFICIENCIES":"deception, intimidation","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I'm earnest and uncommonly direct.-----I strive to have no personality\u2014it's easier to forget what's hardly there.-----I treasure a memento of the person or instance that set me upon my path.-----I sleep just as much as I need to and on an unusual schedule.-----I think far ahead, a detachedness often mistaken for daydreaming.-----I cultivate a single obscure hobby or study and eagerly discuss it at length.-----I am ever learning how to be among others\u2014when to stay quiet, when to laugh.-----I behave like an extreme opposite of my persona.","IDEAL":"Justice. Place in society shouldn't determine one's access to what is right. (Good)-----Security. Doing what must be done can't bring the innocent to harm. (Lawful)-----Confusion. Deception is a weapon. Strike from where your foes won't expect. (Chaotic)-----Infamy. My name will be a malediction, a curse that fulfills my will. (Evil)-----Incorruptibility. Be a symbol, and leave your flawed being behind. (Any)-----Anonymity. It's my deeds that should be remembered, not their instrument. (Any)","BOND":"I do everything for my family. My first thought is keeping them safe.-----What I do, I do for the world. The people don't realize how much they need me.-----I've seen too many in need. I must not fail them as everyone else has.-----I stand in opposition, lest the wicked go unopposed.-----I am exceptional. I do this because no one else can, and no one can stop me.-----I do everything for those who were taken from me.","FLAW":"I am callous about death. It comes to us all eventually.-----I never make eye contact or hold it unflinchingly.-----I have no sense of humor. Laughing is uncomfortable and embarrassing.-----I overexert myself, sometimes needing to recuperate for a day or more.-----I think far ahead, a detachedness often mistaken for daydreaming.-----I see morality entirely in black and white."},{"ID":39,"NAME":"Failed Merchant","SKILL_PROFICIENCIES":"investigation, persuasion","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I didn't have the cutthroat attitude necessary to succeed. I won't make that mistake again.-----Even my competitors said I was affable and talented. Those traits should serve me well.-----To prosper, you have to be in control.-----The customer is always right.-----I was cutting corners and breaking deals to maximize profit. That's why I failed.-----When I get an idea, I am single-minded in its execution\u2014even if it's a terrible idea.-----If I can be everyone's friend, I'll always have support.-----My heart wasn't in being a merchant, so I failed. I'm not all that keen on adventuring either, but I need the money.","IDEAL":"Survival. Where there's life, there's hope. If I remain alive and flexible, I can succeed. (Any)-----Generosity. People helped me when I was down. Now that I'm back on my feet, I'll pay it forward. (Good)-----Excitement. Caution got me nowhere in my previous business. I'm not going to let it hold me back now. (Chaotic)-----Wealth. With enough coin, I can buy comfort, power, knowledge, and even eternal life. Nothing will stand between me and money. (Evil)-----Stability. The mercantile trade was too chaotic for me. I need a nice stable profession, like adventuring. (Lawful)-----Redemption. Too many people consider me a failure. So I need to prove them wrong. (Any)","BOND":"My family means everything to me. I failed them before, and I must not do so again.-----My church provides a connection to my god, so I must ensure that it is protected and funded.-----My former business partner fell ill, and then our business failed. Part of my new venture involves earning enough to take care of their family.-----If I take care of my possessions, they'll take care of me. People come and go, but a weapon or a wand is something you can always rely on.-----Although my business failed, the people of my community were kind to me. I'll do everything in my power to protect them.-----I owe a dangerous person a lot of money. As long as they're happy, they let my debt rest unpaid.","FLAW":"Why spend gold here when you can buy the same thing for copper in the next town?-----I must have the best of everything. Like, right now.-----You haven't heard of me? I'm sure that's because of your ignorance and low breeding.-----I failed, but I'm awesome. So when anyone else is successful, it must be because of nepotism, dishonesty, or dumb luck.-----I find that most people are trustworthy. Hey, where's my belt pouch?-----Nothing gets between me and danger except my fellow adventurers. So I'll be sure to put them there."},{"ID":40,"NAME":"Far Traveler","SKILL_PROFICIENCIES":"insight, perception","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I have different assumptions from those around me concerning personal space, blithely invading others' space in innocence, or reacting to ignorant invasion of my own.-----I have my own ideas about what is and is not food, and I find the eating habits of those around me fascinating, confusing, or revolting.-----I have a strong code of honor or sense of propriety that others don't comprehend.-----I express affection or contempt in ways that are unfamiliar to others.-----I honor my deities through practices that are foreign to this land.-----I begin or end my day with small traditional rituals that are unfamiliar to those around me.","IDEAL":"Open. I have much to learn from the kindly folk I meet along my way. (Good)-----Reserved. As someone new to these strange lands, I am cautious and respectful in my dealings. (Lawful)-----Adventure. I'm far from home, and everything is strange and wonderful! (Chaotic)-----Cunning. Though I may not know their ways, neither do they know mine, which can be to my advantage. (Evil)-----Inquisitive. Everything is new, but I have a thirst to learn. (Neutral)-----Suspicious. I must be careful, for I have no way of telling friend from foe here. (Any)","BOND":"So long as I have this token from my homeland, I can face any adversity in this strange land.-----The gods of my people are a comfort to me so far away from home.-----I hold no greater cause than my service to my people.-----My freedom is my most precious possession. I'll never let anyone take it from me again.-----I'm fascinated by the beauty and wonder of this new land.-----Though I had no choice, I lament having to leave my loved one(s) behind. I hope to see them again one day.","FLAW":"I am secretly (or not so secretly) convinced of the superiority of my own culture over that of this foreign land.-----I pretend not to understand the local language in order to avoid interactions I would rather not have.-----I have a weakness for the new intoxicants and other pleasures of this land.-----I don't take kindly to some of the actions and motivations of the people of this land, because these folks are different from me.-----I consider the adherents of other gods to be deluded innocents at best, or ignorant fools at worst.-----I have a weakness for the exotic beauty of the people of these lands."},{"ID":42,"NAME":"Fisher","SKILL_PROFICIENCIES":"history, survival","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I am unmoved by the wrath of nature.-----My friends are my crew; we sink or float together.-----I need long stretches of quiet to clear my head.-----Rich folk don't know the satisfaction of hard work.-----I laugh heartily, feel deeply, and fear nothing.-----I work hard; nature offers no handouts.-----I dislike bargaining; state your price and mean it.-----Luck favors me, and I take risks others might not.","IDEAL":"{@b Camaraderie.} Good people make even the longest voyage bearable. (Good)-----{@b Luck.} Our luck depends on respecting its rules\u2014now throw this salt over your shoulder. (Lawful)-----{@b Daring.} The richest bounty goes to those who risk everything. (Chaotic)-----{@b Plunder.} Take all that you can and leave nothing for the scavengers. (Evil)-----{@b Balance.} Do not fish the same spot twice in a row; suppress your greed, and nature will reward you. (Neutral)-----{@b Hard Work.} No wave can move a soul hard at work. (Any)","BOND":"I lost something important in the deep sea, and I intend to find it.-----Someone else's greed destroyed my livelihood, and I will be compensated.-----I will fish the many famous waters of this land.-----The gods saved me during a terrible storm, and I will honor their gift.-----My destiny awaits me at the bottom of a particular pond in the Feywild.-----I must repay my village's debt.","FLAW":"I am judgmental, especially of those I deem homebodies or otherwise lazy.-----I become depressed and anxious if I'm away from the sea too long.-----I have lived a hard life and find it difficult to empathize with others.-----I am inclined to tell long-winded stories at inopportune times.-----I work hard, but I play harder.-----I am obsessed with catching an elusive aquatic beast, often to the detriment of other pursuits."},{"ID":43,"NAME":"Folk Hero","SKILL_PROFICIENCIES":"animal handling, survival","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I judge people by their actions, not their words.-----If someone is in trouble, I'm always ready to lend help.-----When I set my mind to something, I follow through no matter what gets in my way.-----I have a strong sense of fair play and always try to find the most equitable solution to arguments.-----I'm confident in my own abilities and do what I can to instill confidence in others.-----Thinking is for other people. I prefer action.-----I misuse long words in an attempt to sound smarter.-----I get bored easily. When am I going to get on with my destiny?","IDEAL":"Respect. People deserve to be treated with dignity and respect. (Good)-----Fairness. No one should get preferential treatment before the law, and no one is above the law. (Lawful)-----Freedom. Tyrants must not be allowed to oppress the people. (Chaotic)-----Might. If I become strong, I can take what I want\u2014what I deserve. (Evil)-----Sincerity. There's no good in pretending to be something I'm not. (Neutral)-----Destiny. Nothing and no one can steer me away from my higher calling. (Any)","BOND":"I have a family, but I have no idea where they are. One day, I hope to see them again.-----I worked the land, I love the land, and I will protect the land.-----A proud noble once gave me a horrible beating, and I will take my revenge on any bully I encounter.-----My tools are symbols of my past life, and I carry them so that I will never forget my roots.-----I protect those who cannot protect themselves.-----I wish my childhood sweetheart had come with me to pursue my destiny.","FLAW":"The tyrant who rules my land will stop at nothing to see me killed.-----I'm convinced of the significance of my destiny, and blind to my shortcomings and the risk of failure.-----The people who knew me when I was young know my shameful secret, so I can never go home again.-----I have a weakness for the vices of the city, especially hard drink.-----Secretly, I believe that things would be better if I were a tyrant lording over the land.-----I have trouble trusting in my allies."},{"ID":44,"NAME":"Gambler","SKILL_PROFICIENCIES":"deception, insight","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I plan for every contingency. Leave nothing to chance!-----Every copper wants to be a silver. Each bet is an opportunity.-----I'm one of Lady Luck's favored. Anything I try is destined to succeed.-----I've lost so much to gambling that I refuse to spend money on anything anymore.-----Nothing is certain. Planning is a coward's act.-----I can't be sure who I've swindled, cheated, or defeated, so I keep a low profile in public.-----The perfect bet is out there somewhere. I just have to keep my eyes open.-----I have beaten my addiction, but all it takes is one weak moment and I'll be back at the card table.","IDEAL":"Knowledge. Knowledge is power, and knowing which horse to back is the key to success. (Any)-----Fate. Whatever happens is fated, regardless of any planning or striving. (Lawful)-----Bravery. If you want to succeed, you have to take risks. (Chaotic)-----Survival. You can't win if you're dead. Live to fight another day\u2014when the odds might be more in your favor. (Any)-----Reliability. When I was in need, I was able to rely on others. Now I want to be the one others rely on. (Good)-----Victory. Winning is the real measure of a person. In the end, the only thing that matters is the scoreboard. (Evil)","BOND":"One person in particular owes me a lot of money, and I need to keep them alive if I want to be repaid.-----I'm loyal to the friend or family member who taught me how to gamble.-----The person who saved me from my gambling addiction is the only reason I'm alive today.-----A patron once fronted me money in exchange for a percentage of my winnings. I owe them a debt of gratitude. And a lot of cash.-----A criminal syndicate I once played for isn't happy I left the game, and its enforcers are looking for me.-----Urchins once helped me find marks for my games. Now I'm driven to help them escape the streets.","FLAW":"I don't know when to quit. Especially when everyone else is telling me to.-----I save my sympathy for my friends, and I have no friends.-----You think we're in trouble now? Let me tell you how bad things are likely to get!-----You can loan me a little, right? I've got a sure thing. I'll double your money, guaranteed.-----I was once a terribly flawed person, like you. Let me tell you how you can save yourself.-----I'm a great gambler. I'm just bad at math and logic."},{"ID":45,"NAME":"Gate Urchin","SKILL_PROFICIENCIES":"deception, sleight of hand","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I appreciate the simple things in life. a song, a warm meal, a sunny day. I don't need any more.-----My problems are always caused by others. I'm never to blame.-----I am afraid I could wind up back on the streets any day.-----I get along with everyone.-----I see people as marks for a con and have difficulty feeling true empathy for them.-----I have a real flair for matchmaking. I can find anyone a spouse!-----I think money is the true measure of appreciation and affection. Everything else is talk or an act.-----I don't like having a lot of stuff, just a few simple things I need. I don't like being tied down and tend to leave things behind when I don't need them anymore.","IDEAL":"Loyal. I never rat out any of my friends, even when the Red Plumes or the Rogues Guild ask. (Lawful)-----Adventurous. I don't like doing the same thing every day. I crave variety. (Chaotic)-----Strong. Only the strong survive. I respect those who are strong and powerful. (Any)-----Witty. Brains are better than brawn. I rely on my wits and respect others who do the same. (Any)-----Honest. Others can do what they want, but I won't lie or steal, even to feed my family. (Good)-----Ungrateful. Those who give, only do it to make themselves feel better. I steal from them. (Evil)","BOND":"The Joydancers of Lliira gave me my instrument when I really needed food. I hate them for that.-----Busking has taught me to love music above all else.-----The Rogues Guild spared me when I did a job without cutting them in. I owe them a great debt.-----I know people hate the Red Plumes, but some of them were really good to me. I help Red Plumes whenever I can, and I respect them. They're just doing what they have to do to get by in this world.-----I will be wealthy some day. My descendants will live in comfort and style.-----I know how hard life on the streets is. I do everything I can for those who have less than me.","FLAW":"Though I no longer live at the Gate, I am still always concerned about where I will get my next meal.-----Years of thieving have become habit. I sometimes steal from strangers without thinking about it.-----I am ashamed of my origins. I pretend I am higher-born and fear others will find out the truth.-----I think people who grew up in houses are soft, spoiled, and ungrateful. I frequently tell them so.-----I am still very uncomfortable wearing nice clothes, sleeping in a warm bed, and eating fine food.-----I do not trust anyone who has not had a hard life. "},{"ID":48,"NAME":"Golgari Agent","SKILL_PROFICIENCIES":"nature, survival","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"Remember, I could kill you in your sleep. Or put centipedes in your bedroll.-----I like to remind people of their inevitable demise.-----Sometimes I give voice to the whispers of the rot, which I hear but no one else does.-----I do my best to discourage anyone from approaching or talking to me.-----I have accepted my death. Hence, I don't fear it.-----Like roots growing through stone, I am relentless and determined in my action.-----I put my knowledge of anatomy to use by narrating the injuries my enemies suffer in grisly detail.-----Like a wild animal, I lash out viciously when I'm provoked\u2014and I'm easily provoked.","IDEAL":"{@b Guild}. My guild is all that really matters. (Any)-----{@b Stoicism}. All of us are part of the cyclical march of nature, which will continue with or without us. (Neutral)-----{@b Nature}. The natural world is more important than the edifices of the city and civilization. (Neutral)-----{@b Interdependence}. We are all part of nature's web. (Lawful)-----{@b Ambition}. The time of Golgari ascendance is at hand, and I intend to have a prominent place in the new world order. (Evil)-----{@b Live and Let Live}. Meddling in the affairs of other guilds is a great way to get squashed like a bug. (Neutral)","BOND":"I cherish the finger of a family member who was {@condition petrified} by a medusa.-----I have an identical twin who is as different from me as any person could be.-----I want to lead one faction of the guild to a new position of dominance.-----I love spending time in the moss-covered building where I took part in my first reclamation mission.-----I found something in the sewer that must never come to light.-----I am forever grateful to the reclaimer who found me floating facedown in the sewer, moments from death.","FLAW":"Death comes for us all, so you can't expect me to take care of someone who can't fight it off.-----I assume that anyone outside the Golgari looks down on me.-----I feel a need for revenge against those who enjoy the privilege of living above ground.-----I don't bother to couch my opinions in flattering words.-----I can't help but pocket any trinket or coin I come across, no matter how worthless.-----I'm convinced that I'm better and stronger than members of other guilds, isolated as they are from the realities of life and death."},{"ID":49,"NAME":"Grinner","SKILL_PROFICIENCIES":"deception, performance","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I love the spotlight. Everyone, look at me!-----Give me a drink and I'm your friend.-----Talk to me about yourself. I'm a hell of a listener.-----I hate to start fights, but I love to finish them.-----I can't sit still.-----I'm always humming an old tune from my past.-----When I don't have a reason to smile, I'm miserable.-----I'm lucky like you wouldn't believe.","IDEAL":"Revolution. Tyrants must fall, no matter the cost. (Chaotic)-----Compassion. The only way to make a better world is to perform small kindnesses. (Good)-----Justice. A nation built upon just foundations will uphold freedom for all. (Law)-----Expression. Music, joy, and laughter are the keys to freedom. (Good)-----Self-Determination. People should be free to do as they please. (Chaotic)-----Vigilance. A free people must be carefully taught, lest they be misled. (Neutral)","BOND":"I lost someone important to an agent of the Dwendalian Empire. That regime will fall.-----The first people to be hurt by this war will be the common folk. I need to protect them.-----Music helped me through a dark time in my life. Now, I'll use music to change the world.-----I will be known as the greatest spy who ever lived.-----All life is precious to me. I know I can change the world without taking a humanoid life.-----The elite in their ivory towers don't understand how we suffer. I intend to show them.","FLAW":"I've never lied once in my life. What? No, I'm not crossing my fingers!-----I do everything big! Subtlety? I don't know the meaning of subtlety! Oh, that's a problem?-----Being a spy in wartime is painful. I've seen so much suffering, I think I'm losing my mind.-----I can't focus on my mission. I just want to carouse and sing and play!-----Yeah, that's my name. Yeah, I'm a Grinner spy. Who cares about staying undercover?-----I can't afford to trust anyone. Not. Anyone."},{"ID":50,"NAME":"Gruul Anarch","SKILL_PROFICIENCIES":"animal handling, athletics","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"Unlike people, the beasts of the wild are friends who won't stab me in the back.-----Go ahead and insult me\u2014I dare you.-----I scorn those who can't survive away from the comforts of the city.-----Don't tell me I'm not allowed to do something.-----Laws are for people who are afraid to face their inner beasts.-----I smear the blood of my enemies over my skin.-----I was, in fact, raised by maaka.-----HarrRRAAGGHH! [I rarely form a coherent sentence and prefer to express myself by breaking things.]","IDEAL":"{@b Clan}. My clan is all that really matters. (Any)-----{@b Anarchy}. No person or law or custom can tell another what to do. (Chaotic)-----{@b Nature}. We weren't born tame or domesticated, so we shouldn't have to live that way. (Neutral)-----{@b Might}. The strongest are meant to dominate the weak. (Evil)-----{@b Rage}. AAAAAARRRRggggh! [To live is to feel and express the rage burning in your belly.] (Chaotic)-----{@b Tradition}. The Old Ways must be preserved and upheld. (Any)","BOND":"I am determined that one day I will lead my clan\u2014or a new one.-----I would give my life for my clan chieftain.-----The chieftain of another clan has a grudge against me.-----I am devoted to a sacred site in the midst of the rubblebelt.-----My weapon is made from the first raktusk I ever hunted.-----GrrrRRAAAAGGHH! [I will do anything to prove myself greater than my siblings or ancestors.]","FLAW":"If you question my courage, I will never back down.-----HrrrGGGAAAARRuuuh! [My anger in battle led to the death of a loved one.]-----I'm as stubborn as a batterboar.-----I'm so convinced of my superiority over soft, civilized people that I'll take great risks to prove it.-----I'm easily manipulated by people I find attractive.-----I'm not actually all that angry."},{"ID":51,"NAME":"Guild Artisan","SKILL_PROFICIENCIES":"insight, persuasion","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I believe that anything worth doing is worth doing right. I can't help it\u2014I'm a perfectionist.-----I'm a snob who looks down on those who can't appreciate fine art.-----I always want to know how things work and what makes people tick.-----I'm full of witty aphorisms and have a proverb for every occasion.-----I'm rude to people who lack my commitment to hard work and fair play.-----I like to talk at length about my profession.-----I don't part with my money easily and will haggle tirelessly to get the best deal possible.-----I'm well known for my work, and I want to make sure everyone appreciates it. I'm always taken aback when people haven't heard of me.","IDEAL":"Community. It is the duty of all civilized people to strengthen the bonds of community and the security of civilization. (Lawful)-----Generosity. My talents were given to me so that I could use them to benefit the world. (Good)-----Freedom. Everyone should be free to pursue his or her own livelihood. (Chaotic)-----Greed. I'm only in it for the money. (Evil)-----People. I'm committed to the people I care about, not to ideals. (Neutral)-----Aspiration. I work hard to be the best there is at my craft. (Any)","BOND":"The workshop where I learned my trade is the most important place in the world to me.-----I created a great work for someone, and then found them unworthy to receive it. I'm still looking for someone worthy.-----I owe my guild a great debt for forging me into the person I am today.-----I pursue wealth to secure someone's love.-----One day I will return to my guild and prove that I am the greatest artisan of them all.-----I will get revenge on the evil forces that destroyed my place of business and ruined my livelihood.","FLAW":"I'll do anything to get my hands on something rare or priceless.-----I'm quick to assume that someone is trying to cheat me.-----No one must ever learn that I once stole money from guild coffers.-----I'm never satisfied with what I have\u2014I always want more.-----I would kill to acquire a noble title.-----I'm horribly jealous of anyone who can outshine my handiwork. Everywhere I go, I'm surrounded by rivals."},{"ID":52,"NAME":"Harborfolk","SKILL_PROFICIENCIES":"athletics, sleight of hand","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I am curious. I want to know why things are the way they are and why people do the things that they do.-----I can't sing, but that never stops me from doing it, loudly. Everyone loves a good sea chanty!-----I think the High Blade is doing a terrific job, don't you?-----I'm very excited that the House Built on Gold is being restored. I am a zealous worshipper of Waukeen.-----I am quite superstitious. I see portents in everyday occurrences.-----I resent the rich and enjoy thwarting their plans and spoiling their fun in small ways.-----I have a sea story to fit every occasion.-----I'm a fisher, but I secretly detest eating fish. I will do anything to avoid it.","IDEAL":"Calm. For all things, there is a tide. I set sail when it is right, and mend my nets when it is not. (Lawful)-----Windblown. I go where the winds blow. No man or woman tells me where or when to sail. (Chaotic)-----Aspiring. I will gain the favor of a Zor or Zora patron, maybe even one of the Blades! (Any)-----Salty. I want people to look to me as an expert on plying Mulmaster Harbor. (Any)-----Selfless. We are all children of the sea. I help everyone in peril afloat and ashore. (Good)-----Let them Drown. I refuse to risk my hide to help others. They wouldn't help me if roles were reversed. (Evil)","BOND":"I once lost everything but my rowboat. I'll do anything to protect it.-----My brother was in the Soldiery, but he was killed. I really look up to the men and women who serve.-----The Cloaks killed my friend for spellcasting. I'll get them back somehow, someday.-----The High House of Hurting helped me when I was hurt and asked nothing in return. I owe them my life.-----I was robbed in the Zhent ghetto once. It will not happen again.-----I would do anything to protect the other harborfolk. They are my family.","FLAW":"I drink too much, which causes me to miss the tide.-----I killed a drunk member of the City Watch in a brawl. I am terrified that they might find out.-----I oversell myself and make promises I can't keep when I want to impress someone.-----Book learning is a waste of time. I have no patience for people who don't speak from experience.-----I almost always cheat. I can't help myself.-----I am a secret informant for the Hawks. I send them reports about everything I see and hear, even what my friends and allies are up to."},{"ID":54,"NAME":"Hermit","SKILL_PROFICIENCIES":"medicine, religion","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I've been isolated for so long that I rarely speak, preferring gestures and the occasional grunt.-----I am utterly serene, even in the face of disaster.-----The leader of my community had something wise to say on every topic, and I am eager to share that wisdom.-----I feel tremendous empathy for all who suffer.-----I'm oblivious to etiquette and social expectations.-----I connect everything that happens to me to a grand, cosmic plan.-----I often get lost in my own thoughts and contemplation, becoming oblivious to my surroundings.-----I am working on a grand philosophical theory and love sharing my ideas.","IDEAL":"Greater Good. My gifts are meant to be shared with all, not used for my own benefit. (Good)-----Logic. Emotions must not cloud our sense of what is right and true, or our logical thinking. (Lawful)-----Free Thinking. Inquiry and curiosity are the pillars of progress. (Chaotic)-----Power. Solitude and contemplation are paths toward mystical or magical power. (Evil)-----Live and Let Live. Meddling in the affairs of others only causes trouble. (Neutral)-----Self-Knowledge. If you know yourself, there's nothing left to know. (Any)","BOND":"Nothing is more important than the other members of my hermitage, order, or association.-----I entered seclusion to hide from the ones who might still be hunting me. I must someday confront them.-----I'm still seeking the enlightenment I pursued in my seclusion, and it still eludes me.-----I entered seclusion because I loved someone I could not have.-----Should my discovery come to light, it could bring ruin to the world.-----My isolation gave me great insight into a great evil that only I can destroy.","FLAW":"Now that I've returned to the world, I enjoy its delights a little too much.-----I harbor dark, bloodthirsty thoughts that my isolation and meditation failed to quell.-----I am dogmatic in my thoughts and philosophy.-----I let my need to win arguments overshadow friendships and harmony.-----I'd risk too much to uncover a lost bit of knowledge.-----I like keeping secrets and won't share them with anyone."},{"ID":55,"NAME":"Hillsfar Merchant","SKILL_PROFICIENCIES":"insight, persuasion","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I fill my evenings with wine or mead and song.-----I greatly admire gladiators and enjoy the Arena.-----I take my wealth for granted. It seldom occurs to me that others aren't rich themselves.-----I leave broken hearts all around the Moonsea and up and down the Sword Coast.-----I work hard and seldom make time for fun.-----I am a particularly devout and pray often.-----The Red Plumes caught me once. I hate them.-----I ask a lot of questions to get information about those with whom I am working and dealing.","IDEAL":"Frugal. I spend my money very carefully. (Lawful)-----Profligate. I tend to spend extravagantly. (Chaotic)-----Honest. I deal with others above board. (Any)-----Sharp. I seek to make the best deal possible. (Any)-----Charitable. I give generously to others. (Good)-----Greedy. I do not share my wealth with others. (Evil)","BOND":"I am fiercely loyal to those with whom I work.-----I must uphold the good name of my family.-----I will prove myself to my family as an adventurer.-----Deals are sacrosanct. I never go back on my word.-----I love making deals and negotiating agreements.-----I guard my wealth jealously.","FLAW":"I am a braggart. I promote myself shamelessly.-----I am vain. I always wear the latest fashions.-----I am a glutton. I eat and drink to excess.-----I am a snob. I want only the finest things in life.-----I am lazy. I want others to take care of everything.-----I am overconfident. I overestimate my abilities."},{"ID":56,"NAME":"Hillsfar Smuggler","SKILL_PROFICIENCIES":"perception, stealth","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"When I'm not smuggling, I gamble.-----I just love Halfling cooking and baking!-----I party with dwarves whenever I can.-----I'm a terrible singer, but I love to do it.-----I was raised to honor Chauntea and still do.-----The blood sports of the Arena sicken me.-----I think non-humans are really interesting.-----I exaggerate the tales of my exploits.","IDEAL":"Fair. I think everyone deserves to be treated fairly. I don't play favorites. (Lawful)-----Impulsive. Planning is often a waste of time. No plan survives contact with reality. It's easier to dive in and deal with the consequences. (Chaotic)-----Curious. I want to learn as much as I can about the people and places I encounter. (Any)-----Prepared. I think success depends on preparing as much as possible in advance. (Any)-----Respectful. I think everyone deserves to be treated with respect and dignity, regardless of their race, creed, color, or origin. (Good)-----Corrupt. I will break the law or act dishonestly if the money is right. (Evil)","BOND":"I am loyal to the Rogues Guild and would do anything for them.-----I love the city of Hillsfar and my fellow Hillsfarians, despite the recent problems.-----I admire the elves. I help them whenever I can.-----A gnome helped me once. I pay the favor forward.-----I enjoy tricking the Red Plumes at every opportunity.-----I smuggled agricultural goods for non-human farmers. I try to help them when I can.","FLAW":"My hatred for the Red Plumes burns so brightly that I have difficulty suppressing It around them.-----The Red Plumes caught me once before, and I was branded for my crime. If they catch me again, for any offense, the punishment will be dire.-----I treat all Hillsfarans poorly. I am disgusted with their failure to revolt against the Great Law of Humanity.-----I have difficulty trusting strangers. Anyone could be a spy for the authorities.-----I am greedy. There Isn't much I won't do for money.-----I'm an informant for the Red Plumes. They let me continue my activities, so long as I pass them information about illegal activity in Hillsfar."},{"ID":57,"NAME":"House Agent","SKILL_PROFICIENCIES":"investigation, persuasion","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I'm always looking to improve efficiency.-----I love to share trivia about my house's business.-----I never forget an insult against me or my house.-----I'm enthusiastic about everything my house does.-----I represent my house and take pride in my looks.-----I'm critical of monarchies and limits on the houses.","IDEAL":"{@b Common Good}. My house serves a vital function, and its prosperity will help everyone. (Good)-----{@b Tradition}. I uphold traditions of my house and bring honor to my family. (Lawful)-----{@b Innovation}. Abandon old traditions and find better ways to do things. (Chaotic)-----{@b Power}. I want to ensure the prosperity of my house and wield its power myself. (Evil)-----{@b Discovery}. I want to learn all I can, both for my house and for my own curiosity. (Any)-----{@b Comfort}. I want to ensure that me and mine enjoy the best things in life. (Any)","BOND":"My house is my family. I would do anything for it.-----I love someone from another house, but the relationship is forbidden.-----Someone I love was killed by a rival faction within my house, and I will have revenge.-----I don't care about the house as a whole, but I would do anything for my old mentor.-----My house must evolve, and I'll lead the evolution.-----I'm determined to impress the leaders of my house, and to become a leader myself.","FLAW":"I'm fixated on following official protocols.-----I'm obsessed with conspiracy theories and worried about secret societies and hidden demons.-----My house and bloodline make me the best!-----My secret could get me expelled from my house.-----My religious beliefs aren't widespread in my house.-----I'm working for a hidden faction in my house that gives me secret assignments."},{"ID":59,"NAME":"Initiate","SKILL_PROFICIENCIES":"athletics, intimidation","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I always have a joke on hand when the mood gets too serious.-----I use sarcasm and insults to keep a distance between myself and my crop-mates, because I don't want to get attached to them.-----I'll settle for nothing less than perfection\u2014in myself, in my cropmates, in everything.-----I'm so focused on the glorious afterlife that nothing in this life can shake my calm resolve.-----I enjoy using my skills to help those who lack those same skills.-----I train hard so that I can play hard at the end of the day. I fully expect to play even harder in the glorious afterlife, but I'm not in a hurry to get there.-----I'm perfectly happy letting others pick up the slack for me while I take it easy.-----I'm constantly sizing up everyone around me, thinking about what kind of opponent they'll be in the final trial.","IDEAL":"Solidarity. The thing that matters most of all is that we're there for each other. (Lawful)-----Knowledge. The world is a puzzle\u2014a mystery waiting to be solved. (Neutral)-----Strength. All that matters to me is my own perfection. Let everyone else seek that perfection in their own way. (Any)-----Ambition. I'm going to prove that I deserve only the best\u2014of everything. (Evil)-----Zeal. Anything worth doing is worth throwing my whole self into. (Any)-----Redemption. I will train all the harder to make up for the doubt I entertained when I was younger. (Any)","BOND":"One of my crop-mates is my dearest friend, and I hope we will face each other in the final trial.-----I am in love with a vizier.-----I am particularly drawn to one of the five gods, and I want nothing more than to win that god's particular favor.-----I am more devoted to Naktamun and its people than I am to any of the ideals of the gods.-----My weapon was a gift from a beloved trainer who died in an accident.-----I carry a memento of my time as an acolyte, and I treasure it above all other things.","FLAW":"I'm easily distracted by an attractive person, which could be the death of me in the trials.-----I really wanted to be a vizier, and I'm angry at the god who didn't choose me.-----Training for a lifetime to die in the end seems like a big waste of energy.-----I'm not at all sure I'll be able to grant a glorified death to any of my crop-mates.-----I have a lasting grudge against one of my crop-mates, and each of us wants to see the other fail.-----I think I've figured out that this world is not what it seems. Something dark is going on here."},{"ID":62,"NAME":"Iron Route Bandit","SKILL_PROFICIENCIES":"animal handling, stealth","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"If people leave their gear unsecured, they must not want it very much.-----I feel more comfortable sleeping under the open sky.-----I always pre-plan my escape should things go bad; I always like to have an exit strategy.-----I tend to give animal owners breeding and care advice whether or not they want it.-----I lost a pet as a child and sadly reflect on it to this day.-----I always form a powerful, emotional bond with my mount.-----I recoil at the thought of killing someone else's pet or mount.-----I prefer to hang to the back of a scuffle or discussion. Better to have my enemies in front of me.","IDEAL":"Loyalty. Never bite the hand that feeds. (Good)-----Unpredictability. Keep your enemy guessing and off-balance like a confused deer. (Chaotic)-----Power. I strive to become leader of the pack at all costs. (Lawful)-----Freedom. I bow to no one I don't respect. (Chaotic)-----Resourcefulness. Our wits are our most valuable resource in troubled times. (Any)-----Unity. Lone wolves fail where the pack succeeds. (Any)","BOND":"I cannot leave a harmed animal behind; I must save it or put it out of its misery.-----I leave behind my own personal calling cards when I do a job.-----I do not trust people who do not have a pet, mount, or furry companion.-----The pelt I wear on my back was from an animal that died saving my life, I will always cherish it.-----If my pet does not like you, I do not like you!-----Once you've ridden with me and fought by my side, I'll be there for you odds be damned.","FLAW":"I talk to animals; I believe they understand me, even if they do not.-----I growl at and bite anyone who gets too close to my food while I am eating.-----I strongly dislike enclosed spaces and require intoxication or firm encouragement to enter them.-----I robbed the wrong caravan once. The owner is a powerful merchant who holds a grudge.-----I'm an inveterate gambler.-----I judge people based on how well they stand their ground in a fight. I got not time for cowards..."},{"ID":63,"NAME":"Izzet Engineer","SKILL_PROFICIENCIES":"arcana, investigation","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I have a hard time staying focused on... oh, and my brain tends to jump from one... did I mention focus?-----I get really excited about my ideas and I can't wait to talk about them and start putting them into practice and tinkering with them and I want to tell you about how exciting it all is!-----It's not magic\u2014or anything, really\u2014if you do it only halfway. Whatever I do, I give it all I've got.-----I do what my gut tells me.-----Life's an experiment, and I can't wait to see what happens.-----I pepper my speech with the incomprehensible jargon of my trade, like mizzium droplets inserted into a weird-field suspension.-----Great ideas are fine, but great results are what counts.-----If you can guess what I'm about to do, that means I've run out of imagination.","IDEAL":"{@b Guild}. My guild is all that really matters. (Any)-----{@b Creativity}. Half the world's troubles come from stodgy thinking, stuck in the past. We need innovative solutions. (Chaotic)-----{@b Discovery}. Every experiment has the potential to reveal more secrets of the multiverse. (Any)-----{@b Science}. A rigorous application of logical principles and protocols will lead us toward progress more surely than any belief system. (Lawful)-----{@b Fun}. I love my job! Despite the dangerous working conditions, there's nothing I'd rather do. (Chaotic)-----{@b Power}. Someday I'll find or create the magic that will make me the most powerful being in Ravnica. (Evil)","BOND":"I have dedicated my life to finding a solution to a scientific problem.-----I'll never forget the laboratory where I learned my skills, or the other attendants who learned alongside me.-----I'm convinced it was sabotage that destroyed my first laboratory and killed many of my friends, and I seek revenge against whoever did it.-----I have the schematics for an invention that I hope to build one day, once I have the necessary resources.-----A fellow student and I are racing to solve the same scientific puzzle.-----I would do anything the guildmaster told me to do.","FLAW":"If there's a plan, I'll probably forget it. If I don't forget it, I'll probably ignore it.-----I get bored easily, and if nothing is happening I'll make something happen.-----Nothing is ever simple, and if it seems simple, I'll find a way to make it complicated.-----I tend to ignore sleep for days when I'm conducting research, often at the expense of my own health and safety.-----I'm convinced there's not a soul in Ravnica, except maybe the great Niv-Mizzet, who can match my boundless intellect.-----I'm incapable of admitting a flaw in my logic."},{"ID":73,"NAME":"Marine","SKILL_PROFICIENCIES":"athletics, survival","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I speak rarely but mean every word I say.-----I laugh loudly and see the humor in stressful situations.-----I prefer to solve problems without violence, but I finish fights decisively.-----I enjoy being out in nature; poor weather never sours my mood.-----I am dependable.-----I am always working on some project or other.-----I become cantankerous and quiet in the rain.-----When the sea is within my sight, my mood is jovial and optimistic.","IDEAL":"{@b Teamwork.} Success depends on cooperation and communication. (Good)-----{@b Code.} The marines' code provides a solution for every problem, and following it is imperative. (Lawful)-----{@b Embracing.} Life is messy. Throwing yourself into the worst of it is necessary to get the job done. (Chaotic)-----{@b Might.} The strong train so that they might rule those who are weak. (Evil)-----{@b Bravery.} To act when others quake in fear\u2014this is the essence of the warrior. (Any)-----{@b Perseverance.} No injury or obstacle can turn me from my goal. (Any)","BOND":"I face danger and evil to offset an unredeemable act in my past.-----I. Will. Finish. The. Job.-----I must set an example of hope for those who have given up.-----I'm searching for a fellow marine captured by an elusive enemy.-----Fear leads to tyranny, and both must be eradicated.-----My commander betrayed my unit, and I will have revenge.","FLAW":"I grow combative and unpredictable when I drink.-----I find civilian life difficult and struggle to say the right thing in social situations.-----My intensity can drive others away.-----I hold grudges and have difficulty forgiving others.-----I become irrational when innocent people are hurt.-----I sometimes stay up all night listening to the ghosts of my fallen enemies."},{"ID":75,"NAME":"Mulmaster Aristocrat","SKILL_PROFICIENCIES":"deception, performance","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"My ambitions are boundless. I will be a Zor or Zora one day!-----I must always look my best.-----Beauty is everywhere. I can find it in even the homeliest person and the most horrible tragedy.-----Decorum must be preserved at all costs.-----I will not admit I am wrong if I can avoid it.-----I am extremely well-educated and frequently remind others of that fact.-----I take what I can today, because I do not know what tomorrow holds.-----My life is full of dance, song, drink, and love.","IDEAL":"Generous. I have a responsibility to help and protect the less fortunate. (Good)-----Loyal. My word, once given, is my bond. (Lawful)-----Callous. I am unconcerned with any negative effects my actions may have on the lives and fortunes of others. (Evil)-----Impulsive. I follow my heart. (Chaotic)-----Ignorant. Explanations bore me. (Neutral)-----Isolationist. I am concerned with the fortunes of my friends and family. Others must see to themselves. (Any)","BOND":"I have dedicated my wealth and my talents to the service of one of the city's many temples.-----My family and I are loyal supporters of High Blade Jaseen Drakehorn. Our fortunes are inexorably tied to hers. I would do anything to support her.-----Like many families who were close to High Blade Selfaril Uoumdolphin, mine has suffered greatly since his fall. We honor his memory in secret.-----My family plotted with Rassendyll Uoumdolphin brother usurped brother as High Blade. Betrayal is the quickest route to power.-----Wealth and power are nothing. Fulfillment can only be found in artistic expression.-----It's not how you feel, who you know, or what you can do - it's how you look, and I look fabulous.","FLAW":"I have difficulty caring about anyone or anything other than myself.-----Having grown up with wealth, I am careless with my finances. I overspend and am overly generous.-----The ends (my advancement) justify any means.-----I must have what I want and will brook no delay.-----My family has lost everything. I must keep up appearances, lest we become a laughingstock.-----I have no artistic sense. I hide that fact behind extreme opinions and have become a trendsetter. "},{"ID":77,"NAME":"Noble","SKILL_PROFICIENCIES":"history, persuasion","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"My eloquent flattery makes everyone I talk to feel like the most wonderful and important person in the world.-----The common folk love me for my kindness and generosity.-----No one could doubt by looking at my regal bearing that I am a cut above the unwashed masses.-----I take great pains to always look my best and follow the latest fashions.-----I don't like to get my hands dirty, and I won't be caught dead in unsuitable accommodations.-----Despite my noble birth, I do not place myself above other folk. We all have the same blood.-----My favor, once lost, is lost forever.-----If you do me an injury, I will crush you, ruin your name, and salt your fields.","IDEAL":"Respect. Respect is due to me because of my position, but all people regardless of station deserve to be treated with dignity. (Good)-----Responsibility. It is my duty to respect the authority of those above me, just as those below me must respect mine. (Lawful)-----Independence. I must prove that I can handle myself without coddling from my family. (Chaotic)-----Power. If I can attain more power, no one will tell me what to do. (Evil)-----Family. Blood runs thicker than water. (Any)-----Noble Obligation. It is my duty to protect and care for the people beneath me. (Good)","BOND":"I will face any challenge to win the approval of my family.-----My house's alliance with another noble family must be sustained at all costs.-----Nothing is more important than the other members of my family.-----I am in love with the heir of a family that my family despises.-----My loyalty to my sovereign is unwavering.-----The common folk must see me as a hero of the people.","FLAW":"I secretly believe that everyone is beneath me.-----I hide a truly scandalous secret that could ruin my family forever.-----I too often hear veiled insults and threats in every word addressed to me, and I'm quick to anger.-----I have an insatiable desire for carnal pleasures.-----In fact, the world does revolve around me.-----By my words and actions, I often bring shame to my family."},{"ID":78,"NAME":"Orzhov Representative","SKILL_PROFICIENCIES":"intimidation, religion","LANGUAGES":null,"LANGUAGES_COUNT":2,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I am always willing to act in accordance with the financial incentive offered.-----Debts are never meant to be forgiven.-----I am accustomed to enjoying the finest pleasures money can buy.-----No one could doubt that I am a cut above the masses of pitiful peasants that infest the city.-----I can't stand to spend a zib more than necessary to purchase what I need.-----I hate it when people try to make light of a serious situation.-----I want to make sure everyone is aware of how wealthy, powerful, and important I am.-----I can't think of anything to look forward to.","IDEAL":"{@b Guild}. My guild is all that really matters. (Any)-----{@b Wealth}. I will do whatever it takes to become as rich as the oligarchs. (Evil)-----{@b Power}. One day, I will be the one giving orders. (Evil)-----{@b Prestige}. I want to be admired, respected, feared, or even hated for my position and wealth. (Evil)-----{@b Stability}. The economy functions best when chaos is kept under control and everyone knows their place. (Lawful)-----{@b Eternity}. I want to live forever\u2014in the flesh as long as possible, and as a spirit afterward. (Any)","BOND":"The unbearable weight of my debt has driven me to desperation.-----I'm duty-bound to obey the dictates of an ancestor on the Ghost Council.-----I value my worldly goods more highly than my mortal life.-----An oligarch publicly humiliated me, and I will exact revenge on that whole family.-----My faith in the Obzedat never wavers.-----I want to prove myself more worthy than an older sibling and thereby ensure that I inherit a greater share of my parents' wealth.","FLAW":"I hold a scandalous secret that could ruin my family forever\u2014but could also earn me the favor of the Ghost Council.-----I'm convinced that everyone I know is plotting against me.-----I'll brave any risk if the monetary reward is great enough.-----I am convinced that I am far more important than anyone else is willing to acknowledge.-----I have little respect for anyone who isn't wealthy.-----I'll take any opportunity to steal from wealthier people, even for worthless trinkets."},{"ID":79,"NAME":"Outlander","SKILL_PROFICIENCIES":"athletics, survival","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":" I'm driven by a wanderlust that led me away from home.-----I watch over my friends as if they were a litter of newborn pups.-----I once ran twenty-five miles without stopping to warn to my clan of an approaching orc horde. I'd do it again if I had to.-----I have a lesson for every situation, drawn from observing nature.-----I place no stock in wealthy or well-mannered folk. Money and manners won't save you from a hungry owlbear.-----I'm always picking things up, absently fiddling with them, and sometimes accidentally breaking them.-----I feel far more comfortable around animals than people.-----I was, in fact, raised by wolves.","IDEAL":"Change. Life is like the seasons, in constant change, and we must change with it. (Chaotic)-----Greater Good. It is each person's responsibility to make the most happiness for the whole tribe. (Good)-----Honor. If I dishonor myself, I dishonor my whole clan. (Lawful)-----Might. The strongest are meant to rule. (Evil)-----Nature. The natural world is more important than all the constructs of civilization. (Neutral)-----Glory. I must earn glory in battle, for myself and my clan. (Any)","BOND":"My family, clan, or tribe is the most important thing in my life, even when they are far from me.-----An injury to the unspoiled wilderness of my home is an injury to me.-----I will bring terrible wrath down on the evildoers who destroyed my homeland.-----I am the last of my tribe, and it is up to me to ensure their names enter legend.-----I suffer awful visions of a coming disaster and will do anything to prevent it.-----It is my duty to provide children to sustain my tribe.","FLAW":"I am too enamored of ale, wine, and other intoxicants.-----There's no room for caution in a life lived to the fullest.-----I remember every insult I've received and nurse a silent resentment toward anyone who's ever wronged me.-----I am slow to trust members of other races, tribes, and societies.----- Violence is my answer to almost any challenge.----- Don't expect me to save those who can't save themselves. It is nature's way that the strong thrive and the weak perish."},{"ID":80,"NAME":"Phlan Insurgent","SKILL_PROFICIENCIES":"stealth, survival","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"My patience knows no bounds, so long as my goal is in sight.-----In life and in struggle, the ends justify my actions.-----If you aren't helping me, you'd best at least stay out of my way.-----I long for the life that was taken away from me.-----Friends and family perished, tragically, before my eyes. I hope never to undergo that again.-----Making the right choices in life are important to me. The choices I make might save not just my life, but the lives of others as well.-----I can never allow my foes to get the drop on me.-----Time is a precious resource that I must spend wisely.","IDEAL":"Leadership. The oppressed need someone to inspire them to courageous acts. (Good)-----Unpredictability. Keeping the enemy guessing and off-balance is my tactical strength. (Chaos)-----Determination. Threats to my home must be eliminated at all costs. (Any)-----Freedom. Those who are enslaved and unjustly imprisoned deserve my aid. (Good)-----Resourcefulness. Our wits are our most valuable resource in troubled times. (Any)-----Unity. Working together, we can overcome all obstacles, even the most seemingly insurmountable ones. (Any)","BOND":"I'll never let my fellow insurgents down. They are my only remaining friends.-----I was separated from a loved one during my escape from town. I will find them.-----One of the Tears of the Virulence was a trusted friend, until the day they betrayed the city. They will pay harshly for their transgressions.-----An item I hold close is my last remaining connection to the family I lost during the fall.-----The dragon who took my past life away from me will feel the full extent of my vengeance.-----The knowledge in Mantor's Library is an irreplaceable treasure that must be protected.","FLAW":"I have no respect for those who flee. I harbor a deep grudge against the citizens who abandoned Phlan.-----Ale is the only way I can escape the desperation of my circumstances.-----It doesn't take much to get me into a fight.-----Being an insurgent means doing things that aren't always ethical. I'm still learning to live with that.-----My desire to liberate Phlan oftentimes clouds my judgment, despite my best efforts.-----I relentlessly despise the Maimed Virulence and his allies. I'd abandon other goals in order to strike out at them."},{"ID":81,"NAME":"Phlan Refugee","SKILL_PROFICIENCIES":"insight, athletics","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I may have lost everything I worked for most of my life, but there's work to be done, no time to linger on the past.-----I worked hard to get where I am and I refuse to let a little hardship stop me from succeeding.-----I protect those around me, you never know when one of them will be useful.-----I have always gotten ahead by giving, why change now?-----I prepare for everything, it paid off in Phlan and it will pay off again.-----I will reclaim my home, though the path may be long, I will never give up hope.-----I never cared for personal hygiene, and am amazed that It bothers others.-----I am always willing to volunteer my services, just as long as don't have to do anything.","IDEAL":"Justice. Corruption brought Phlan down, I will not tolerate that any longer. (Lawful)-----Acceptance. Stability is a myth, to think you can control your future is futile. (Chaotic)-----Hope. I am guided by a higher power and I trust that everything will be right in the end. (Good)-----Restraint. I hate those who caused my loss. It is all I can do not to lash out at them. (Any)-----Strength. As shown in Phlan, the strong survive. If you are weak you deserve what you get (Evil)-----Openness. I am always willing to share my life story with anyone who will listen. (Any)","BOND":"I have the chance at a new life and this time I am going to do things right.-----The Lord Regent brought this suffering upon his people. I will see him brought to justice.-----I await the day I will be able to return to my home in Phlan.-----I will never forget the debt owed to Glevith of the Welcomers. I will be ready to repay that debt when called upon.-----There was someone I cared about in Phlan, I will find out what happened to them.-----Some say my life wasn't worth saving, I will prove them wrong.","FLAW":"I used the lives of children to facilitate my escape from Phlan.-----I am a sucker for the underdog, and always bet on the loosing team.-----I am incapable of standing up for myself.-----I will borrow money from friends with no intention to repay it.-----I am unable to keep secrets. A secret is just an untold story.-----When something goes wrong, it's never my fault."},{"ID":82,"NAME":"Plaintiff","SKILL_PROFICIENCIES":"medicine, persuasion","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I can't believe I have a chance to join Acquisitions Incorporated! The fun I'm going to have!-----I've been wronged my entire life, and the world owes me.-----I have always tried to make the best of a bad situation.-----The law doesn't protect the honest and the hard working. I'm going to do whatever needs to be done to make things right.-----I'm always in the wrong place at the wrong time.-----My superiors are smarter and wiser than I am. I do what I'm told.-----Never pass up the opportunity to make an easy bit of coin. That's my motto.-----I'm beginning to feel like the gods are not on my side.","IDEAL":"Justice. Those who break the law need to answer for their crimes. (Lawful)-----Freedom. People must have the freedom to do what they want and pursue their dreams. (Chaotic)-----Greed. Everyone I see is getting theirs, so I'm surely going to get mine. (Evil)-----Chaos. You're out of order! And you're out of order! This whole realm is out of order! (Chaotic)-----Humility. I'm just a small part of a larger whole. So is everyone else. (Neutral)-----Responsibility. We all have our roles to play. I'll hold up my end of the bargain. (Any)","BOND":"Others hurt in the same accident that hurt me are my new family. I'll make sure they're taken care of.-----The rulers of this place were kind to me, and they have my lifelong devotion.-----My parents worry about me, but I'll make them proud.-----The only bond that matters is the one holding my money pouch to my belt.-----The other new hires at Acquisitions Incorporated are my allies. We have each other's backs.-----My legal counsel is my best friend. I owe all my forthcoming opportunities to their hard work.","FLAW":"The person who gains the most reward for the least effort wins.-----Three magic beans for just one cow? What a deal!-----I have only one vice, but it controls my life.-----Sleep is for the weak. We need to keep training more if we're going to be ready for the challenges ahead.-----Until my songs are sung in every tavern in this realm, I won't be satisfied.-----If people find me unpleasant, that's their problem."},{"ID":86,"NAME":"Rakdos Cultist","SKILL_PROFICIENCIES":"acrobatics, performance","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I revel in mayhem, the more destructive the better.-----When violence breaks out, I lose myself in rage, and it's sometimes hard to stop.-----Everything is funny to me, and the most hilarious and bloodiest things leave me cackling with sadistic glee.-----I derive genuine pleasure from the pain of others.-----I enjoy testing other people's patience.-----I can't stand it when things are predictable, so I like to add a little chaos to every situation.-----I throw my weight around to make sure I get my way.-----I enjoy breaking delicate works of art. And fingers, which are sort of the same.","IDEAL":"{@b Guild}. My guild is all that really matters. (Any)-----{@b Hedonism}. Death comes for everyone, so take as much pleasure as you can from every moment of life. (Neutral)-----{@b Creativity}. I strive to find more ways to express my art through pain\u2014my own as well as others'. (Chaotic)-----{@b Freedom}. No one tells me what to do. (Chaotic)-----{@b Equality}. I want to see Ravnica remade, with no guilds and no hierarchies. (Chaotic)-----{@b Spectacle}. People are inspired by the greatness they see in art. (Any)","BOND":"I have belonged to the same performance troupe for years, and these people mean everything to me.-----A blood witch told me I have a special destiny to fulfill, and I'm trying to figure out what it is.-----I'm secretly hoping that I can change the cult from the inside, using my influence to help rein in the wanton violence.-----I own something that Rakdos once touched (it's seared black at the spot), and I cherish it.-----I want to be better at my chosen form of performance than any other member of my troupe.-----I am devoted to Rakdos and live to impress him.","FLAW":"My family is prominent in another guild. I enjoy my wild life, but I don't want to embarrass them.-----I couldn't hide my emotions and opinions even if I wanted to.-----I throw caution to the wind.-----I resent the rich and powerful.-----When I'm angry, I lash out in violence.-----There's no such thing as too much pleasure."},{"ID":88,"NAME":"Rival Intern","SKILL_PROFICIENCIES":"history, investigation","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"My previous employer didn't respect me, and now I'll do whatever I can to gain respect.-----The job is important, but the relationships I forge with my coworkers are even more so.-----The job is everything to me. Who needs relaxation, hobbies, and a social life?-----I know I'm not the best and brightest, but if I put my best self forward, I can overcome anything.-----My former boss was an idiot. So was my boss before that. And before that. I'm sure those were all coincidences.-----This company is so much better than my previous one. It will always be the best until they stop paying me.-----I know this dagger belongs to the company, but I'm sure they won't miss it. Or this flask. Or this armor.-----It's only a matter of time before I'll be upper management. I just have to kiss up to my superiors and kick down those beneath me.","IDEAL":"Advancement. Money and power can be gained more easily within an organization. I plan to gain as much as possible. (Evil)-----Structure. Life goes much more smoothly when you follow the rules and work within a system. (Lawful)-----Uncertainty. The more chaos that swirls around me, the more opportunities I can find to profit. (Chaotic)-----Justice. I can't stand people being treated unjustly. I do whatever it takes to stop injustice and those who flout the law. (Lawful)-----Pleasure. What's the use of working hard and making money if you can't enjoy the finer things in life? (Any)-----Power. Money is fine, but real power means never having to say you're sorry. (Evil)","BOND":"I have a family member in need. I consider them in everything I do.-----My peers keep me grounded.-----My past mistakes cost someone else dearly. I have to rectify that.-----A childhood mentor put me on my current path. If I succeed, I want to repay that mentor in some way.-----I value an oath of loyalty I took to a group of friends over everything else in my life.-----Although I don't get along well with people, my pet means the world to me.","FLAW":"I know what's best. Trust me.-----Flaw? I have no flaws. I'm perfect.-----My loyalties are... fluid.-----If anything goes wrong, it must be someone else's fault. Let me explain that in detail.-----There's right and there's wrong, and there's no gray area in between.-----Our superiors might not like what you're doing. I'm going to have to put that in my report."},{"ID":90,"NAME":"Sage","SKILL_PROFICIENCIES":"arcana, history","LANGUAGES":null,"LANGUAGES_COUNT":2,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I use polysyllabic words that convey the impression of great erudition.-----I've read every book in the world's greatest libraries\u2014or I like to boast that I have.-----I'm used to helping out those who aren't as smart as I am, and I patiently explain anything and everything to others.-----There's nothing I like more than a good mystery.-----I'm willing to listen to every side of an argument before I make my own judgment.-----I... speak... slowly... when talking... to idiots,... which... almost... everyone... is... compared... to me.-----I am horribly, horribly awkward in social situations.-----I'm convinced that people are always trying to steal my secrets.","IDEAL":"Knowledge. The path to power and self-improvement is through knowledge. (Neutral)-----Beauty. What is beautiful points us beyond itself toward what is true. (Good)-----Logic. Emotions must not cloud our logical thinking. (Lawful)-----No Limits. Nothing should fetter the infinite possibility inherent in all existence. (Chaotic)-----Power. Knowledge is the path to power and domination. (Evil)-----Self-Improvement. The goal of a life of study is the betterment of oneself. (Any)","BOND":"It is my duty to protect my students.-----I have an ancient text that holds terrible secrets that must not fall into the wrong hands.-----I work to preserve a library, university, scriptorium, or monastery.-----My life's work is a series of tomes related to a specific field of lore.-----I've been searching my whole life for the answer to a certain question.-----I sold my soul for knowledge. I hope to do great deeds and win it back.","FLAW":"I am easily distracted by the promise of information.-----Most people scream and run when they see a demon. I stop and take notes on its anatomy.-----Unlocking an ancient mystery is worth the price of a civilization.-----I overlook obvious solutions in favor of complicated ones.-----I speak without really thinking through my words, invariably insulting others.-----I can't keep a secret to save my life, or anyone else's."},{"ID":91,"NAME":"Sailor","SKILL_PROFICIENCIES":"athletics, perception","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"My friends know they can rely on me, no matter what.-----I work hard so that I can play hard when the work is done.-----I enjoy sailing into new ports and making new friends over a flagon of ale.-----I stretch the truth for the sake of a good story.-----To me, a tavern brawl is a nice way to get to know a new city.-----I never pass up a friendly wager.-----My language is as foul as an otyugh nest.-----I like a job well done, especially if I can convince someone else to do it.","IDEAL":"Respect. The thing that keeps a ship together is mutual respect between captain and crew. (Good)-----Fairness. We all do the work, so we all share in the rewards. (Lawful)-----Freedom. The sea is freedom\u2014the freedom to go anywhere and do anything. (Chaotic)-----Mastery. I'm a predator, and the other ships on the sea are my prey. (Evil)-----People. I'm committed to my crewmates, not to ideals. (Neutral)-----Aspiration. Someday, I'll own my own ship and chart my own destiny. (Any)","BOND":"I'm loyal to my captain first, everything else second.-----The ship is most important\u2014crewmates and captains come and go.-----I'll always remember my first ship.-----In a harbor town, I have a paramour whose eyes nearly stole me from the sea.-----I was cheated out of my fair share of the profits, and I want to get my due.-----Ruthless pirates murdered my captain and crewmates, plundered our ship, and left me to die. Vengeance will be mine.","FLAW":"I follow orders, even if I think they're wrong.-----I'll say anything to avoid having to do extra work.-----Once someone questions my courage, I never back down no matter how dangerous the situation.-----Once I start drinking, it's hard for me to stop.-----I can't help but pocket loose coins and other trinkets I come across.-----My pride will probably lead to my destruction."},{"ID":92,"NAME":"Secret Identity","SKILL_PROFICIENCIES":"deception, stealth","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"Despite its problems, I love Hillsfar, it's the greatest city in the world. The only one for me.-----I move from place to place, never staying anywhere long and leaving nothing behind.-----I think flattery is the best way to direct attention away from me.-----I don't make friends easily. They're a liability I cannot afford.-----Risk and danger are exhilarate me. Pulling off schemes and deceptions is a rush.-----The First Lord is right, humans are superior. I really admire them, despite the atrocities.-----I avoid people of my own race, as well as things associated with my race, lest they give me away.-----I live for the Arena. I admire gladiators and enjoy the thrill of blood on the sands!","IDEAL":"Quisling. Supporting the rulers of the land and following the laws is the road to salvation. (Lawful)-----Scoflaw. The laws and lawmakers are corrupt. I follow laws only when it suits me. (Chaotic)-----Optimist. Everyone Is basically good. Though the government is misguided it will all be okay. (Any)-----Secretive. I am in the habit of not talking about myself. My business is none of yours. (Any)-----Heroic. I do everything I can to help non-humans, regardless of the personal cost to me. (Good)-----Depraved. I have lost my moral compass. The ends justify most any means. (Evil)","BOND":"The humans of Hillsfar have inflicted terrible harm on me, my family, and my race. I will have revenge.-----I am part of an underground network that smuggles non-humans into and out of the city.-----I am a partisan. I commit minor acts of defiance against the First Lord and Red Plumes when I can.-----I am a spy. I report on events in and around Hillsfar.-----My secret identity is the only thing protecting me from the Arena. I will stop at nothing to maintain it.-----I am madly in love with a human who does not know my true identity, and I fear rejection if I reveal it.","FLAW":"After years of denying who I am, I now despise myself and other members of my pathetic race.-----Years of hiding have made me somewhat paranoid. I trust no one.-----I've been lying so often and for so long that I can't help it anymore. I frequently lie for no reason at all.-----I am ashamed. I failed to protect a member of my family who was seized and thrown into the Area.-----I am struggling with maintaining my secret identity. I subconsciously want to get caught and therefore sometimes let my secret identity slip.-----Years of successfully deceiving others have made me cocky. I think no one can see through my lies."},{"ID":93,"NAME":"Selesnya Initiate","SKILL_PROFICIENCIES":"nature, persuasion","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I never raise my voice or lose my temper.-----I feel the pains and joys of everyone around me, friend or foe.-----I would rather make a friend than thwart an enemy.-----I'm always straining to peer into another reality that seems to be just beyond my senses.-----I'm uneasy if I can't see plants growing or feel soil beneath my feet.-----Seeing illness or injury in any creature saddens me.-----I have much to be proud of, but I am still just one strand in the grand, interwoven tapestry of life.-----Nature offers rich and abundant metaphors for understanding the complexities of life.","IDEAL":"{@b Guild}. My guild is all that really matters. (Any)-----{@b Harmony}. Nothing is more beautiful than voices and actions aligned in common purpose. (Good)-----{@b Order}. Like a well-pruned tree, society thrives when everything is kept in good order. (Lawful)-----{@b Life}. Preserving life and nature is always a worthwhile endeavor. (Good)-----{@b Humility}. Ambition and pride are the roots of strife. (Good)-----{@b Evangelism}. When all have joined the Selesnya Conclave, Ravnica will finally know peace. (Any)","BOND":"I would give my life in the defense of the small enclave where I first encountered Mat'Selesnya.-----I love beasts and plants of all kinds, and am loath to harm them.-----A healer nursed me to recovery from a mortal illness.-----I'll sing the invitation of Mat'Selesnya with my dying breath.-----I cherish a leaf from Vitu-Ghazi that changes color with the seasons, even though it is no longer attached to the tree.-----Every member of the conclave is my kin, and I would fight for any one of them.","FLAW":"I'm terrified of getting into a fight where my side is outnumbered.-----I assume that people mean well until they prove otherwise.-----I enjoy comfort and quiet, and prefer to avoid extra effort.-----I have a fierce temper that doesn't reflect the inner calm I seek.-----I'm convinced that everyone else in the conclave has a deeper connection to the Worldsoul than I do.-----I'm trying to atone for the life of crime I led before I joined the Selesnya, but I find it hard to give up my bad habits."},{"ID":94,"NAME":"Shade Fanatic","SKILL_PROFICIENCIES":"deception, intimidation","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I am a bully; I try to hide it though.-----I let my actions speak for themselves-----I am important; I will not let anyone forget that.-----You are either with me or against me.-----I know it is only a time before I am betrayed by those I care for.-----I never understand why people get so emotional.-----They are out to get me. It is only my cunning that keeps me ahead of them-----Everyone has a choice, the one I make is always right though.","IDEAL":"Hope. I know even if I need do evil acts, history will be my redemption. (Chaos)-----Dedicated. I can do anything I put my mind to (Lawful)-----Exciting. I have found the truth of the Shadovar and want to share it with everyone. (Any)-----Frugal. I horde my possessions knowing that someday I will be called upon to give everything I have to the cause (Any)-----Eloquent. I use my words to sway others to my beliefs. (Any)-----Compassionate. It is through love that others will join in our cause. (Good)","BOND":"They say the Shade broke the bonds of mortality; I want to find out how.-----The whispers in my head remind me that there is power to be found in the shadows.-----For the glory of Netheril, I will grow in power.-----I once lived in Hillsfar, I was chased out before I was able to say farewell.-----My true love was a killed by the Red Plumes; I plot to make them suffer.-----I had a loved one die in the arena at Hillsfar; I am out to prove I am stronger than them!","FLAW":"I always over exaggerate my abilities.-----I cannot bear to let those I care for out of my sight.-----I am incapable of standing up for myself.-----The group I am with has committed atrocities; I am always worried their actions will become public.-----I always enjoy a good mug of ale... or five.-----I know what I do is wrong, but am afraid to speak up about it."},{"ID":95,"NAME":"Shipwright","SKILL_PROFICIENCIES":"history, perception","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I love talking and being heard more than I like to listen.-----I'm extremely fond of puzzles.-----I thrive under pressure.-----I love sketching and designing objects, especially boats.-----I'm not afraid of hard work\u2014in fact, I prefer it.-----A pipe, an ale, and the smell of the sea: paradise.-----I have an endless supply of cautionary tales related to the sea.-----I don't mind getting my hands dirty.","IDEAL":"Crew. If everyone on deck pitches in, we'll never sink. (Good)-----Careful Lines. A ship must be balanced according to the laws of the universe. (Lawful)-----Invention. Make what you need out of whatever is at hand. (Chaotic)-----Perfection. To measure a being and find it lacking is the greatest disappointment. (Evil)-----Reflection. Muddied water always clears in time. (Any)-----Hope. The horizon at sea holds the greatest promise. (Any)","BOND":"I must visit all the oceans of the world and behold the ships that sail there.-----Much of the treasure I claim will be used to enrich my community.-----I must find a kind of wood rumored to possess magical qualities.-----I repair broken things to redeem what's broken in myself.-----I will craft a boat capable of sailing through the most dangerous of storms.-----A kraken destroyed my masterpiece; its teeth shall adorn my hearth.","FLAW":"I don't know when to throw something away. You never know when it might be useful again.-----I get frustrated to the point of distraction by shoddy craftsmanship.-----Though I am an excellent crafter, my work tends to look as though it belongs on a ship.-----I am so obsessed with sketching my ideas for elaborate inventions that I sometimes forget little thing like eating and sleeping.-----I'm judgmental of those who are not skilled with tools of some kind.-----I sometimes take things that don't belong to me, especially if they are very well made."},{"ID":97,"NAME":"Simic Scientist","SKILL_PROFICIENCIES":"arcana, medicine","LANGUAGES":null,"LANGUAGES_COUNT":2,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I can't wait to see what I become next!-----I am convinced that everything inclines toward constant improvement.-----I'm eager to explain every detail of my most intricate experiments and theories to anyone who shows the least bit of interest.-----I assume that everyone needs even the most basic concepts explained to them.-----I describe everything that happens as if it were going into my research notes (and it often is).-----I am insatiably curious about the seemingly infinite forms and adaptations of life.-----I can't resist prying into anything forbidden, since it must be terribly interesting.-----I employ a highly technical vocabulary to avoid imprecision and ambiguity in my communication.","IDEAL":"{@b Guild}. My guild is all that really matters. (Any)-----{@b Change}. All life is meant to progress toward perfection, and our work is to hurry it along\u2014no matter what must be upended along the way. (Chaotic)-----{@b Knowledge}. Understanding the world is more important than what you do with your knowledge. (Neutral)-----{@b Greater Good}. I want to reshape the world into higher forms of life so that all can enjoy evolution. (Good)-----{@b Logic}. It's foolish to let emotions and principles interfere with the conclusions of logic. (Lawful)-----{@b Superiority}. My vast intellect and strength are directed toward increasing my sway over others. (Evil)","BOND":"I helped create a krasis that I love like a pet and would carry with me everywhere... except it's the size of a building, and it might eat me.-----In my laboratory, I discovered something that I think could eliminate half the life on Ravnica.-----The other researchers in my clade are my family\u2014a big, eccentric family including members and parts of many species.-----The laboratory where I did my research contains everything that is precious to me.-----I will get revenge on the shortsighted fool who killed my precious krasis creation.-----Everything I do is an attempt to impress someone I love.","FLAW":"I have a rather embarrassing mutation that I do everything I can to keep hidden.-----I'm more interested in taking notes on monstrous anatomy than in fighting monsters.-----Every social situation I'm in seems to lead to my asking rude personal questions.-----I'm supremely confident in my ability to adapt to any situation and handle any danger.-----I'll take any risk to earn recognition for my scientific brilliance.-----I have a tendency to take shortcuts in my research and any other tasks I have to complete."},{"ID":98,"NAME":"Smuggler","SKILL_PROFICIENCIES":"athletics, deception","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I love being on the water but hate fishing.-----I think of everything in terms of monetary value.-----I never stop smiling.-----Nothing rattles me; I have a lie for every occasion.-----I love gold but won't cheat a friend.-----I enjoy doing things others believe to be impossible.-----I become wistful when I see the sun rise over the ocean.-----I am no common criminal; I am a mastermind.","IDEAL":"{@b Wealth} Heaps of coins in a secure vault is all I dream of. (Any)-----{@b Smuggler's Code} I uphold the unwritten rules of the smugglers, who do not cheat one another or directly harm innocents. (Lawful)-----{@b All for a Coin} I'll do nearly anything if it means I turn a profit. (Evil)-----{@b Peace and Prosperity} I smuggle only to achieve a greater goal that benefits my community. (Good)-----{@b People} For all my many lies, I place a high value on friendship. (Any)-----{@b Daring} I am most happy when risking everything. (Any)","BOND":"My vessel was stolen from me, and I burn with the desire to recover it.-----I intend to become the leader of the network of smugglers that I belong to.-----I owe a debt that cannot be repaid in gold.-----After one last job, I will retire from the business.-----I was tricked by a fellow smuggler who stole something precious from me. I will find that thief.-----I give most of my profits to a charitable cause, and I don't like to brag about it.","FLAW":"Lying is reflexive, and I sometimes engage in it without realizing.-----I tend to assess my relationships in terms of profit and loss.-----I believe everyone has a price and am cynical toward those who present themselves as virtuous.-----I struggle to trust the words of others.-----Few people know the real me.-----Though I act charming, I feel nothing for others and don't know what friendship is."},{"ID":99,"NAME":"Soldier","SKILL_PROFICIENCIES":"athletics, intimidation","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I'm always polite and respectful.-----I'm haunted by memories of war. I can't get the images of violence out of my mind.-----I've lost too many friends, and I'm slow to make new ones.-----I'm full of inspiring and cautionary tales from my military experience relevant to almost every combat situation.-----I can stare down a hell hound without flinching.-----I enjoy being strong and like breaking things.-----I have a crude sense of humor.-----I face problems head-on. A simple, direct solution is the best path to success.","IDEAL":"Greater Good. Our lot is to lay down our lives in defense of others. (Good)-----Responsibility. I do what I must and obey just authority. (Lawful)-----Independence. When people follow orders blindly, they embrace a kind of tyranny. (Chaotic)-----Might. In life as in war, the stronger force wins. (Evil)-----Live and Let Live. Ideals aren't worth killing over or going to war for. (Neutral)-----Nation. My city, nation, or people are all that matter. (Any)","BOND":"I would still lay down my life for the people I served with.-----Someone saved my life on the battlefield. To this day, I will never leave a friend behind.-----My honor is my life.-----I'll never forget the crushing defeat my company suffered or the enemies who dealt it.-----Those who fight beside me are those worth dying for.-----I fight for those who cannot fight for themselves.","FLAW":"The monstrous enemy we faced in battle still leaves me quivering with fear.-----I have little respect for anyone who is not a proven warrior.-----I made a terrible mistake in battle that cost many lives\u2014and I would do anything to keep that mistake secret.-----My hatred of my enemies is blinding and unreasoning.-----I obey the law, even if the law causes misery.-----I'd rather eat my armor than admit when I'm wrong."},{"ID":100,"NAME":"Stojanow Prisoner","SKILL_PROFICIENCIES":"deception, perception","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I am a bully; others will suffer as I have.-----I always say yes even when I mean no; it's just easier.-----I aim to misbehave.-----I go out of my way to frustrate or anger those in power.-----I strive to obey the law. I will never again make the mistake of going against authority.-----I always plan everything out. The one time I let others plan things it did not end well for me.-----I take blame to protect others from pain.-----I hoard information, you never know what may come in handy.","IDEAL":"Loss. I freely give those who offend me what was so brutally denied me, death. (Chaos)-----Dedication. I never betray those who trust me. (Law)-----Vengeance. I use any means to get information I need; I have been well taught. (Evil)-----Redemption. Everyone deserves a second chance. (Good)-----Resilience. I can survive any challenge (Any)-----Leadership. The best teams are made up of those that society has discarded.","BOND":"I take up arms to help establish a free Phlan.-----The horrors of my time in Stojanow haunt my dreams, only after a day of hard work can I find sleep.-----I am indebted to those who freed me from prison, I will repay this debt.-----My torturer survived the attack that set me free, I will find him\/her.-----I will not rest while others suffer fates similar to mine.-----I am searching for a way to heal the scars of Stojanow, both physical and emotional.","FLAW":"During stressful times, I find myself crying for no reason.-----My nerve endings are shot from the interrogations; I am numb to all but the harshest touch.-----I am incapable of standing up for myself.-----I folded under the torture, and gave information that I promised would be kept secret. My life would be in jeopardy if others found out.-----Survival is worth more than friendship.-----The ghosts from my past hinder my actions."},{"ID":101,"NAME":"Ticklebelly Nomad","SKILL_PROFICIENCIES":"animal handling, nature","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I eagerly inject myself into the unknown.-----Villages, towns, and cities do not suit me. I'd rather be out in the wilderness any day.-----I accomplish my tasks efficiently, using as few resources as possible.-----It's difficult for me to remain in one place for long.-----I loudly brag about my tribe every chance I get.-----Having walked among giants, I am fearless in the face of bigger creatures.-----I am quiet and reserved, but observant. Nothing escapes my attention.-----My word is my bond. I see a promise to completion, even if it conflicts with my beliefs.","IDEAL":"Kinship. Family is most important in life. Though I may be far from my own, the bonds of family must be protected in others' lives as well. (Good)-----Preservation. Nature must not be despoiled by encroaching civilization. (Any)-----Wanderlust. One must expand their horizons by seeing the world and exploring. (Chaos)-----Isolation. My tribe and its ways must be protected and shielded from outside influence. (Neutral)-----Protection. Threats to the land and to the people must be dealt with at any and all costs. (Law)-----Belonging: All creatures have a place in the world, so I strive to help others find theirs. (Good)","BOND":"I ache to return to my tribe and the family I left, but cannot until my obligations are fulfilled.-----The dragon cultists that invaded my homeland stole away one of my tribe's people. I will not know rest until I've found them.-----The dragon's presence in the hills destroyed valuable territory and resulted in deaths within my tribe. The creature must pay for what it has done.-----I carry a trinket that spiritually and emotionally ties me to my people and my home.-----I discovered a strange relic in the hills during my tribe's wanderings. I must discover what it is.-----One of the stone giant clans from the Giant's Cairn has graced me with a mark of kinship.","FLAW":"I throw myself and my friends into situations rarely ever thinking about consequences.-----Unfamiliar people and surroundings put me on edge.-----I have absolutely no patience for slowpokes and those who prove indecisive.-----My desire to experience new things causes me to make unsafe choices.-----I am overly protective of nature, sometimes to the detriment of my companions and myself.-----My lack of worldliness often proves my undoing in social, commercial, and hostile situations."},{"ID":102,"NAME":"Trade Sheriff","SKILL_PROFICIENCIES":"investigation, persuasion","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I am always polite and respectful-----I let my actions speak for themselves-----I am haunted by my past having seen the murder of a close friend or family member and it is the one case I always needed to solve but have not been able to.-----I am quick to judge and slow to vindicate-----I can be very persuasive and am able to ask quest ions where others might not be able to.-----I have a quirky personality that seems to take others off their guard.-----My sense of humor is considered by most to be awkward.-----Everyone has a choice, and they can always make the right choice, mine!","IDEAL":"Hope. my job is to speak for the victim (Good)-----Dedicated. Once I start an investigation, until told to do so, I do not quit, not matter where it leads. (Lawful)-----Nation. My city, nation, or people are all that matter. (Any)-----Mercenary. When I do investigations, I expect answers immediately. (Any)-----Eloquent. I use my words to sway others to give me answers. (Good)-----Might. It is through threats and force that I get my answers. (Lawful)","BOND":"To this day an unsolved case will always leave me haunted and bother me.-----Through the might of my personality I will solve an investigation or puzzle.-----It is my right to believe what I will, just try and stop me.-----I need to prove my worth to my fellow Sheriffs-----Someone I cared for died under suspicious circumstances. I will find out what happened to them and bring their killer to justice.-----I speak for those that cannot speak for themselves.","FLAW":"I always over exaggerate my abilities.-----I cannot bear to let those I care for out of my sight.-----I took a bribe to tank an investigation and I would do anything to keep it secret.-----I have little respect for those that are of \"low\" intelligence\/race.-----I always enjoy a good mug of ale... or five to cover up my past.-----I speak for the First Lord of Hillsfar and make sure everyone knows it."},{"ID":104,"NAME":"Urchin","SKILL_PROFICIENCIES":"sleight of hand, stealth","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I hide scraps of food and trinkets away in my pockets.-----I ask a lot of questions.-----I like to squeeze into small places where no one else can get to me.-----I sleep with my back to a wall or tree, with everything I own wrapped in a bundle in my arms.-----I eat like a pig and have bad manners.-----I think anyone who's nice to me is hiding evil intent.-----I don't like to bathe.-----I bluntly say what others are hinting at or hiding.","IDEAL":"Respect. All people, rich or poor, deserve respect. (Good)-----Community. We have to take care of each other, because no one else is going to do it. (Lawful)-----Change. The low are lifted up, and the high and mighty are brought down. Change is the nature of things. (Chaotic)-----Retribution. The rich need to be shown what life and death are like in the gutters. (Evil)-----People. I help the people who help me\u2014that's what keeps us alive. (Neutral)-----Aspiration. I'm going to prove that I'm worthy of a better life. (Any)","BOND":"My town or city is my home, and I'll fight to defend it.-----I sponsor an orphanage to keep others from enduring what I was forced to endure.-----I owe my survival to another urchin who taught me to live on the streets.-----I owe a debt I can never repay to the person who took pity on me.-----I escaped my life of poverty by robbing an important person, and I'm wanted for it.-----No one else should have to endure the hardships I've been through.","FLAW":"If I'm outnumbered, I will run away from a fight.-----Gold seems like a lot of money to me, and I'll do just about anything for more of it.-----I will never fully trust anyone other than myself.-----I'd rather kill someone in their sleep than fight fair.-----It's not stealing if I need it more than someone else.-----People who can't take care of themselves get what they deserve."},{"ID":113,"NAME":"Vizier","SKILL_PROFICIENCIES":"history, religion","LANGUAGES":null,"LANGUAGES_COUNT":null,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"Everything I do, I do gracefully and deliberately, and with complete confidence. (Oketra)-----Nothing can shake my rock-hard focus. (Oketra)-----When I am at peace, I am an oasis of perfect calm in the world. When I am roused to anger, I am an embodiment of terror. (Kefnet)-----I enjoy teasing acolytes and initiates with juicy tidbits of knowledge wrapped up in fiendishly difficult puzzles. (Kefnet)-----I have the utmost faith in myself and my abilities. (Rhonas)-----I get restless when life in the city feels too tame, too safe. (Rhonas)-----I enjoy solitude as an opportunity to plan my victory. (Bontu)-----I use satire as a way to undermine the teachings of the other gods. (Bontu)-----I love, fight, and feast with equal zeal. (Hazoret)-----I think of those in my care as my family, in a way that most people have trouble understanding. (Hazoret)","IDEAL":"Solidarity. The worthy must respect the worthy. In the afterlife, all will be united in goal and action. (Oketra)-----Knowledge. The worthy shall cultivate a nimble mind, so as to perceive the wonders beyond imagination that wait in the afterlife. (Kefnet)-----Strength. The worthy shall hone a strong body that can withstand the boundless energies of the afterlife. (Rhonas)-----Ambition. The worthy shall strive for greatness, for supremacy in life leads to supremacy in the afterlife. (Bontu)-----Zeal. The worthy shall rush to the God-Pharaoh's side with relentless passion, rising to overcome every obstacle in their way. (Hazoret)-----Naktamun. The life of the city is ordered according to the plan of the God-Pharaoh, and that order must be preserved at all costs.","BOND":"My loyalty to my companions embodies the ideal of loyalty to my god. (Oketra)-----The teachings of my god are more precious to me than any possession. (Kefnet)-----I would do anything to defend the temple of my god from any harm or desecration. (Rhonas)-----I am committed to the service of my god\u2014because it's my sure ticket into the afterlife. (Bontu)-----I love my god and never want my service to end. (Hazoret)-----I have a close friend or lover who is also a vizier.","FLAW":"I am in love with an initiate, and I want to shield this person from death in the trials.-----I secretly wish I had not been chosen as a vizier, so I could participate in the trials as an initiate.-----I secretly question whether the gods care at all about us or what we do.-----A vizier of another god seeks my death in retribution for a past insult.-----I am terrified of what lies beyond the Gate to the Afterlife.-----I secretly believe the God-Pharaoh's return will not bring blessing to this world."},{"ID":114,"NAME":"Volstrucker Agent","SKILL_PROFICIENCIES":"deception, stealth","LANGUAGES":null,"LANGUAGES_COUNT":1,"TOOL_PROFICIENCIES":null,"EQUIPMENT":null,"TRAIT":"I prefer to keep my thoughts to myself.-----I indulge vice in excess to quiet my conscience.-----I've left emotion behind me. I'm now perfectly placid.-----Some event from the past keeps worming its way into my mind, making me restless.-----I always keep my word\u2014except when I'm commanded to break it.-----I laugh off insults and never take them personally.","IDEAL":"Order. The will of the crown is absolute. (Law)-----True Loyalty. The Cerberus Assembly is greater than any power, even the crown. (Law)-----Death. The penalty for disloyalty is death. (Evil)-----Determination. I cannot fail. Not ever. (Neutral)-----Fear. People should not respect power. They should fear it. (Evil)-----Escape. The Volstrucker are pure evil! I can't atone for what I've done for them, but I can escape with my life. (Any)","BOND":"The job is all that matters. I will see it through.-----My orders are important, but my comrades are worth more than anything. I would die for them.-----Everything I've done, I've done to protect someone close to me.-----If the empire falls, all of civilization falls with it. I will hold back chaos and barbarism at any cost.","FLAW":"I drink to dull the pain in the back of my head.-----I go a bit mad when I see blood.-----I can hear the voices of everyone I've killed. I see their faces. I can't be free of these ghosts.-----Fear is a powerful motivator. I will do whatever it takes to prevent those who know what I am from seeing me fail, and from those I care about from knowing what I am."}]
